static void AdjustHeadTail(E *&h, E *&t, E *p1, E *p2) {
 if(p1 == h)
 h = p2;
 else if(p2 == h)
 h = p1;

 if(p1 == t)
 t = p2;
 else if(p2 == t)
 t = p1;
 }

