static void SLItemSwap(E *&h, E *&t, E *p1, E *p2) {
 E *tmp;
 if(p1 && p2 && p1 != p2) {
 if(p1->pNext != p2 && p1->pPrior != p2) {
 AdjustHeadTail(h, t, p1, p2);

 MO_SORT_SWAP(tmp, p1->pNext, p2->pNext);
 if(p1->pNext)
 p1->pNext->pPrior = p1;
 if(p2->pNext)
 p2->pNext->pPrior = p2;

 MO_SORT_SWAP(tmp, p1->pPrior, p2->pPrior);
 if(p1->pPrior)
 p1->pPrior->pNext = p1;
 if(p2->pPrior)
 p2->pPrior->pNext = p2;

 } else if(p1->pNext == p2) {
 AdjustHeadTail(h, t, p1, p2);
 p1->pNext = p2->pNext;
 if(p1->pNext)
 p1->pNext->pPrior = p1;
 p2->pPrior = p1->pPrior;
 if(p2->pPrior)
 p2->pPrior->pNext = p2;
 p1->pPrior = p2;
 p2->pNext = p1;

 } else {
 MO_SORT_SWAP(tmp, p1, p2);
 SLItemSwap(h, t, p1, p2);
 }
 }
 }

static void SetQuickSort(E *&pHead, E *&pTail,IComparer<T>* pComparer){
 if(pHead != pTail) {
 //T tmp;
 T data = pHead->code;
 E *last = pHead;
 E *tmp;

 for(E *p = pHead->pNext; p != pTail->pNext; p = p->pNext) {
 if(pComparer->Compare(p->code, data) < 0) {
 last = last->pNext;
 SLItemSwap(pHead, pTail, last, p);
 MO_SORT_SWAP(tmp, last, p);
 }
 }

 tmp = pHead;
 SLItemSwap(pHead, pTail, tmp, last);
 last = tmp;

 if(last != pHead){
 last = last->pPrior;
 SetQuickSort(pHead, last, pComparer);
 }
 if(tmp != pTail){
 tmp = tmp->pNext;
 SetQuickSort(tmp, pTail, pComparer);
 }
 }
 }

