TUint32 MO_STDCALL __MO_THREAD_CALLBACK(TAny* pParam){
 // 
 FThread* pThread = (FThread*)pParam;
 MO_ASSERT(pThread);
 // 
 TInt result = EFailure;
 if(pThread->OnStart()){
 try{
 MO_TRAP( result = pThread->Process() );
 }catch(TInt code){
 pThread->OnCancel(code);
 }
 pThread->OnFinish(result);
 }
 // 
 MO_PTR_DELETE(pThread);
 return result;
}

