void FApplication::OnSegmentFault(int signum, siginfo_t* info, TAny* ptr){
 // 
 static const char* si_codes[3] = {"", "SEGV_MAPERR", "SEGV_ACCERR"};
 ucontext_t* pUcontext = (ucontext_t*)ptr;
 // 
 fprintf(stderr, "Segmentation Fault!
");
 fprintf(stderr, " info.si_signo = %d
", signum);
 fprintf(stderr, " info.si_errno = %d
", info->si_errno);
 fprintf(stderr, " info.si_code = %d (%s)
", info->si_code, si_codes[info->si_code]);
 fprintf(stderr, " info.si_addr = %p
", info->si_addr);
 // 
 for(TInt i = 0; i < NGREG; i++){
 fprintf(stderr, "reg[%02" MO_FMT_INT "] = 0x%" MO_FMT_HEX "
", i, pUcontext->uc_mcontext.gregs[i]);
 }
#if defined(SIGSEGV_STACK_X86) || defined(SIGSEGV_STACK_IA64)
 TAny** ppBp = NULL;
 TAny* pIp = NULL;
# if defined(SIGSEGV_STACK_IA64)
 pIp = (TAny*)pUcontext->uc_mcontext.gregs[REG_RIP];
 ppBp = (TAny**)pUcontext->uc_mcontext.gregs[REG_RBP];
# elif defined(SIGSEGV_STACK_X86)
 pIp = (TAny*)pUcontext->uc_mcontext.gregs[REG_EIP];
 ppBp = (TAny**)pUcontext->uc_mcontext.gregs[REG_EBP];
# endif
 // 
 fprintf(stderr, "Stack trace:
");
 TInt32 level = 0;
 Dl_info dlinfo;
 while(ppBp && pIp) {
 if(!dladdr(pIp, &dlinfo)){
 break;
 }
 TCharC *pSymName = dlinfo.dli_sname;
#ifndef NO_CPP_DEMANGLE
 TInt32 status;
 TChar* pTemp = abi::__cxa_demangle(pSymName, NULL, 0, &status);
 if(status == 0 && pTemp){
 pSymName = pTemp;
 }
#endif
 fprintf(stderr, "-> %02d: %p [%-48s+%04u] (%s)
",
 ++level, pIp, pSymName, (unsigned)((char*)pIp - (char*)dlinfo.dli_saddr), dlinfo.dli_fname);
#ifndef NO_CPP_DEMANGLE
 if(NULL != pTemp){
 free(pTemp);
 }
#endif
 if(dlinfo.dli_sname && !strcmp(dlinfo.dli_sname, "main")){
 break;
 }
 pIp = ppBp[1];
 ppBp = (TAny**)ppBp[0];
 }
#else
 fprintf(stderr, "Stack trace (non-dedicated):
");
 void* buffer[MO_BACKTRACE_MAXCOUNT];
 TInt count = backtrace(buffer, MO_BACKTRACE_MAXCOUNT);
 char** ppStrings = backtrace_symbols(buffer, count);
 for(TInt n=0; n<count; n++){
 fprintf(stderr, "-> %s
", ppStrings[n]);
 }
#endif
 fprintf(stderr, "End of stack trace
");
#if _DEBUG
 // core
 FObject* pObject = NULL; pObject->HashCode();
#endif
 exit(-1);
}

