TInt FApplication::CatchSegmentFault(){
#ifdef _LINUX
 struct sigaction action;
 memset(&action, 0, sizeof(action));
 action.sa_flags = SA_SIGINFO;
 action.sa_sigaction = OnSegmentFault;
 if(sigaction(SIGSEGV, &action, NULL) < 0){
 perror("sigaction");
 return EError;
 }
 if(sigaction(SIGABRT, &action, NULL) < 0){
 perror("sigaction");
 return EError;
 }
 if(sigaction(SIGTRAP, &action, NULL) < 0){
 perror("sigaction");
 return EError;
 }
 if(sigaction(SIGFPE, &action, NULL) < 0){
 perror("sigaction");
 return EError;
 }
 if(sigaction(SIGSTKFLT, &action, NULL) < 0){
 perror("sigaction");
 return EError;
 }
#endif
 return ESuccess;
}

//============================================================
// <T></T>
//
//============================================================

TInt FApplication::CatchInterrupt(){
#ifdef _LINUX
 sigset_t sig_int;
 sigemptyset(&sig_int);
 sigaddset(&sig_int, SIGINT);
 if(SIG_ERR == signal(SIGINT, OnSignalInterrupt)){
 MO_STATIC_ERROR("Set SIG_INT handler error.");
 return EError;
 }
 if(sigprocmask(SIG_UNBLOCK, &sig_int, NULL)){
 MO_STATIC_ERROR("Set SIG_INT unblock error.");
 return EError;
 }
#endif
 return ESuccess;
}

