inline void InnerInitialize(TInt size){
 // <C>MO_MEMORY_CAPACITY</C>
 this->_length = 0;
 this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
 this->_pMemory = RTypeMemory<T>::Alloc(this->_size, 0);
 }

void operator=(const MPtrC<T>& ptr){
 Assign(ptr.MemoryC(), ptr.Length());
 }

void operator=(const MArrayC<T>& values){
 Assign(values.MemoryC(), values.Length());
 }

void operator=(const FArray<T>& values){
 Assign(values.MemoryC(), values.Length());
 }

void EnsureSize(TInt size){
 if(size > this->_size){
 // 1.5<C>MO_MEMORY_CAPACITY</C>
 this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
 this->_size += this->_size >> 1;
 T* pMemory = RTypeMemory<T>::Alloc(this->_size, 0);
 if(this->_length > 0){
 RTypes<T>::Copy(pMemory, this->_pMemory, this->_length);
 }
 RTypeMemory<T>::Free(this->_pMemory);
 this->_pMemory = pMemory;
 }
 }

