// <T></T>
//
// @param pEntry 
//============================================================

void FBlockAllocator::EntryRemove(SMemoryEntry* pEntry){
 MO_ASSERT(pEntry);
 SMemoryEntry* pPrior = pEntry->pPrior;
 SMemoryEntry* pNext = pEntry->pNext;
 // 
 if(NULL == pPrior){
 _pFirst = pNext;
 }else{
 pPrior->pNext = pNext;
 }
 // 
 if(NULL == pNext){
 _pLast = pPrior;
 }else{
 pNext->pPrior = pPrior;
 }
 // 
 _count--;
 // 
 pEntry->pNext = _pUnused;
 _pUnused = pEntry;
}

