 // 
 if(NULL == _pUnused){
 EntryExtend();
 }
 // 
 SMemoryEntry* pEntry = _pUnused;
 _pUnused = pEntry->pNext;
 // 
 EntryPush(pEntry);
 // 
 pEntry->Alloc();
 // 
 return pEntry;
}

