inline SEntry* EntryCreate(){
 EnsureSize(this->_count + 1);
 return MO_CREATE(SEntry);
 }

inline void EntryRelease(SEntry* pEntry){
 MO_ASSERT(pEntry);
 MO_DELETE(pEntry);
 }

inline SEntry** EntryFlatCreate(TInt size){
 return RTypeMemory<SEntry*>::Alloc(size, NULL);
 }

inline void EntryFlatRelease(SEntry** pEntries){
 MO_ASSERT(pEntries);
 RTypeMemory<SEntry*>::Free(pEntries);
 }

void EnsureSize(TInt size){
 if(NULL == this->_ppEntries) {
 this->_entryCount = MO_MAX(size, MO_OBJECT_CAPACITY);
 // 
 this->_ppEntries = EntryFlatCreate(this->_entryCount);
 } else if (size > (this->_entryCount << 3)) {
 // 
 size = this->_entryCount + (MO_MAX(this->_entryCount, size) >> 1);
 // 8
 SEntry** ppEntries = EntryFlatCreate(size);
 EntriesResize(ppEntries, size);
 // 
 EntryFlatRelease(this->_ppEntries);
 // 
 this->_ppEntries = ppEntries;
 this->_entryCount = size;
 }
 }

E* Alloc(){
 // 
 if(NULL == _pFirst){
 _pStorage->AllocList(_capacity, &_pFirst, &_pLast);
 _count += _capacity;
 }
 // 
 E* pEntry = _pFirst;
 _pFirst = pEntry->pNext;
 if(NULL == _pFirst){
 _pLast = NULL;
 }
 pEntry->pNext = NULL;
 _count--;
 return pEntry;
 }

void Free(E* pEntry){
 MO_ASSERT(pEntry);
 // 
 _count++;
 if(NULL == _pFirst){
 _pLast = pEntry;
 }else{
 pEntry->pNext = _pFirst;
 }
 _pFirst = pEntry;
 // 
 if(_count > _total){
 Release();
 }
 }

void FreeList(TInt count, E* pFirst, E* pLast){
 MO_ASSERT(pFirst);
 MO_ASSERT(pLast);
 // 
 _count += count;
 if(NULL == _pFirst){
 _pLast = pLast;
 }else{
 pLast->pNext = _pFirst;
 }
 _pFirst = pFirst;
 // 
 if(_count > _total){
 Release();
 }
 }

void Release(){
 if(NULL != _pFirst){
 // 
 _pStorage->FreeList(_count, _pFirst, _pLast);
 _count = 0;
 _pFirst = NULL;
 _pLast = NULL;
 }
 }

