inline E* EntryShift(){
 E* pEntry = _pRead;
 if(NULL != _pRead){
 // 
 _pRead = _pRead->pNext;
 if(NULL == _pRead){
 _pWrite = NULL;
 }else{
 _pRead->pPrior = NULL;
 }
 // 
 _count--;
 pEntry->pPrior = NULL;
 pEntry->pNext = NULL;
 }
 return pEntry;
 }

inline void EntryPush(E* pEntry){
 MO_ASSERT(pEntry);
 if(NULL == _pWrite){
 _pRead = pEntry;
 }else{
 _pWrite->pNext = pEntry;
 }
 // 
 _count++;
 pEntry->pPrior = _pWrite;
 pEntry->pNext = NULL;
 // 
 _pWrite = pEntry;
 }

inline void EntryRemove(E* pEntry){
 MO_ASSERT(pEntry);
 // 
 E* pPrior = pEntry->pPrior;
 if(NULL == pPrior){
 MO_ASSERT(pEntry == _pRead);
 _pRead = pEntry->pNext;
 if(NULL != _pRead){
 _pRead->pPrior = NULL;
 }
 }else{
 pPrior->pNext = pEntry->pNext;
 }
 // 
 E* pNext = pEntry->pNext;
 if(NULL == pNext){
 MO_ASSERT(pEntry == _pWrite);
 _pWrite = pEntry->pPrior;
 if(NULL != _pWrite){
 _pWrite->pNext = NULL;
 }
 }else{
 pNext->pPrior = pEntry->pPrior;
 }
 // 
 _count--;
 pEntry->pPrior = NULL;
 pEntry->pNext = NULL;
 }

