TBool Flip(TInt& count, E** ppRead, E** ppWrite){
 TBool result = EFalse;
 _section.Enter();
 if(NULL != _pRead){
 // 
 count = _count;
 *ppRead = _pRead;
 *ppWrite = _pWrite;
 // 
 _count = 0;
 _pRead = NULL;
 _pWrite = NULL;
 result = ETrue;
 }
 _section.Leave();
 return result;
 }

