 MO_ASSERT(pRead);
 MO_ASSERT(pWrite);
 _section.Enter();
 // 
 _count += count;
 // 
 if(NULL == _pWrite){
 _pRead = pRead;
 }else{
 _pWrite->pNext = pRead;
 pRead->pPrior = _pWrite;
 }
 _pWrite = pWrite;
 _section.Leave();
 return ETrue;
 }

