TBool AllocList(TInt count, E** ppFirst, E** ppLast){
 E* pFirst = NULL;
 E* pLast = NULL;
 E* pAlloc = NULL;
 _section.Enter();
 while(--count >= 0){
 // 
 if(NULL == _pUnused){
 //pAlloc = MO_CALLOC(_pAllocator, E);
 _total++;
 }else{
 pAlloc = _pUnused;
 _pUnused = pAlloc->pNext;
 _count--;
 }
 // 
 pAlloc->pNext = NULL;
 if(NULL == pFirst){
 pFirst = pAlloc;
 pLast = pAlloc;
 }else{
 pLast->pNext = pAlloc;
 pLast = pAlloc;
 }
 }
 *ppFirst = pFirst;
 *ppLast = pAlloc;
 _section.Leave();
 return ETrue;
 }

