TBool FFileBinary::LoadFile(TCharC* pFileName){
 // 
 TFileHandle handle;
#ifdef _WINDOWS
 fopen_s(&handle, pFileName, "rb");
#else
 handle = fopen(pFileName, "rb");
#endif
 if(NULL == handle){
 MO_PERROR(fopen);
 return EFalse;
 }
 // 
 if(ESuccess != fseek(handle, 0, SEEK_END)){
 MO_PERROR(fseek);
 return EFalse;
 }
 TInt length = ftell(handle);
 EnsureSize(length);
 // 
 if(ESuccess != fseek(handle, 0, SEEK_SET)){
 MO_PERROR(fseek);
 return EFalse;
 }
 TInt readed = fread(_pMemory, length, 1, handle);
 if(1 != readed){
 MO_PFATAL(fread);
 }
 // 
 if(ESuccess != fclose(handle)){
 MO_PFATAL(fclose);
 }
 return ETrue;
}

