//============================================================
// <T></T>
//============================================================

TBool FFileLines::LoadFile(TCharC* pFileName){
 if(!pFileName)
 return EFalse;

 FILE *fp;
#ifdef _WINDOWS
 if(fopen_s(&fp, pFileName, "r")){
 return EFalse;
 }
#else
 if(!(fp = fopen(pFileName, "r")))
 return EFalse;
#endif

 Clear();

 TChar *p;
 TChar buf[MO_MAX_LINE];
 FString *fsp;
 while(fgets(buf, sizeof(buf), fp)) {
 fsp = MO_CREATE(FString);
 while(!(p = strrchr(buf, '
'))) {
 fsp->Append(buf);
 if(!fgets(buf, sizeof(buf), fp))
 break;
 }
 if(p) {
 *p = 0;
 }
 if((p = strrchr(buf, ''))) {
 *p = 0;
 }
 fsp->Append(buf);
 _pLines->Push(fsp);
 }
 fclose(fp);

 return ETrue;
}

//============================================================
// <T></T>
//============================================================

TBool FFileLines::SaveFile(TCharC* pFileName){
 if(!pFileName){
 return EFalse;
 }
 FILE* pFile = NULL;

#ifdef _WINDOWS
 if(fopen_s(&pFile, pFileName, "w")){
 return EFalse;
 }
#else
 if(!(pFile = fopen(pFileName, "w"))){
 MO_PERROR(fopen);
 return EFalse;
 }
#endif

 TVectorIteratorC<FString*> iterator = _pLines->IteratorC();
 while(iterator.Next()){
 fputs(iterator->MemoryZ(), pFile);
 fputc('
', pFile);
 }
 fclose(pFile);
 return ETrue;
}

