//============================================================
// <T></T>
//
// @param fileName 
//============================================================

TBool FFileStream::SaveAs(TCharC* pFileName){
 // 
 TInt size = Length();
 rewind(_handle);
 // 
#ifdef _WINDOWS
 TFileHandle handle;
 fopen_s(&handle, pFileName, "w");
#else
 TFileHandle handle = fopen(pFileName, "w");
#endif
 if(NULL == handle){
 MO_PERROR(fopen);
 return EFalse;
 }
 // 
 TBool result = ETrue;
 TByte buffer[MO_FILE_BUFFER];
 while(size > 0){
 TInt length = (size > MO_FILE_BUFFER) ? MO_FILE_BUFFER : size;
 // 
 TInt lengthRead = fread(buffer, length, 1, _handle);
 TInt lengthWrite = fwrite(buffer, lengthRead, 1, handle);
 // 
 if(lengthRead != lengthWrite){
 MO_PERROR(fwrite);
 result = EFalse;
 break;
 }
 size = size - lengthRead;
 }
 // 
 if(ESuccess != fclose(handle)){
 MO_PERROR(fclose);
 return EFalse;
 }
 return result;
}

