 TInt length = ftell(handle);
 EnsureSize(length);

 TInt readed;
 TChar* buffer = RTypeMemory<TChar>::Alloc(length, 0);

 TInt result = MO_LIB_STRICMP(pCharSet, RCharSet::Utf8);
 if(result == 0){
 fseek(handle, 3, SEEK_SET);
 readed = fread(buffer, length - 3, 1, handle);
 MultiByteToWideChar(CP_UTF8, 0, buffer, length, _pMemory, _length);
 }else{
 fseek(handle, 2, SEEK_SET);
 readed = fread(_pMemory, length - 2, 1, handle);
 }

 if(1 != readed){
 MO_PFATAL(fread);
 }

 if(ESuccess != fseek(handle, 0, SEEK_SET)){
 MO_PERROR(fseek);
 return EFalse;
 }
 // 
 if(ESuccess != fclose(handle)){
 MO_PFATAL(fclose);
 }
 RTypeMemory<TChar>::Free(buffer);
 return ETrue;
}

