//============================================================

TBool FFileString32::LoadFile(TCharC* pFileName, TCharC* pCharSet){
 TFileHandle handle;
#ifdef _WINDOWS
 fopen_s(&handle, pFileName, "rb");
#else
 handle = fopen(pFileName, "rb");
#endif
 if(NULL == handle){
 MO_PERROR(fopen);
 return EFalse;
 }
 // 
 if(ESuccess != fseek(handle, 0, SEEK_END)){
 MO_PERROR(fseek);
 return EFalse;
 }
 TInt length = ftell(handle);
 EnsureSize(length);
 TInt readed;
 TUchar8 head[4];

 TChar* buffer = RTypeMemory<TChar>::Alloc(length, 0);

 int result = MO_LIB_STRICMP(pCharSet, RCharSet::Utf32);

 if(result != 0){
 readed = fread(buffer, length, 1, handle);
 TChar* pIn = buffer;
 TChar16* pOut = _pMemory;
 iconv_t cd;
 cd = iconv_open("utf-32", pCharSet);
 MO_ASSERT(iconv(cd, &pIn, (TUint*)&length, (TChar**)&pOut, (TUint*)&_length) != -1);
 iconv_close(cd);
 _length = length;
 }else{
 readed = fread(_pMemory, length, 1, handle);
 _length = length;
 }

 if(1 != readed){
 MO_PFATAL(fread);
 }

 if(ESuccess != fseek(handle, 0, SEEK_SET)){
 MO_PERROR(fseek);
 return EFalse;
 }
 // 
 if(ESuccess != fclose(handle)){
 MO_PFATAL(fclose);
 }
 RTypeMemory<TChar>::Free(buffer);
 return ETrue;
}

