//============================================================
// <T></T>
//
// @param result 
// @param level 
// @param pSender 
// @param pMethod 
// @param start 
// @param current 
// @param pMessage 
// @param ... 
//============================================================

void FLoggerConsole::Format(TFsLogger& result, TLoggerLevel level, TAny* pSender, TCharC* pMethod, TDateTime start, TDateTime current, TCharC* pMessage, va_list params){
 // 
 TFsDateTime datetime = current;
 TTimeSpan span = 0;
 if(start > 0){
 span = current - start;
 }
 // 
 result.Append(datetime.Foramt(_format));
 result.Append('|');
 // 
 switch(level){
 case ELoggerLevel_Debug:
 result.Append('D');
 break;
 case ELoggerLevel_Info:
 result.Append('I');
 break;
 case ELoggerLevel_Warn:
 result.Append('W');
 break;
 case ELoggerLevel_Error:
 result.Append('E');
 break;
 case ELoggerLevel_Fatal:
 result.Append('F');
 break;
 }
 result.Append('.');
 // 
 FThread* pThread = RThreadManager::Instance().Current();
 if(NULL != pThread){
 result.Append(pThread->Code());
 result.AppendFormat("-%04d", pThread->Index());
 }else{
 result.AppendFormat("%08X", RThread::CurrentId());
 }
 // 
 result.Append(" [ ");
 result.Append(pMethod);
 if(NULL != pSender){
 result.Append('@');
 result.AppendFormat("%08X", pSender);
 }
 if(span > 0){
 // 
 TFsNumber number;
 number.AppendFormat("%d", span);
 number.Append("ms");
 result.PadRight(' ', MO_LOGGER_PAD_LENGTH - number.Length());
 result.Append(number);
 }else{
 // 
 result.PadRight(' ', MO_LOGGER_PAD_LENGTH);
 }
 result.Append(" ] ");
 // 
 TChar message[MO_FS_LOGGER_LENGTH];
#ifdef _WINDOWS
 vsprintf_s(message, MO_FS_LOGGER_LENGTH, pMessage, params);
#else
 vsnprintf(message, MO_FS_LOGGER_LENGTH, pMessage, params);
#endif
 message[MO_FS_LOGGER_LENGTH - 1] = 0;
 result.Append(message);
 result.Append("
");
}

//============================================================
// <T></T>
//
// @param level 
// @param pSender 
// @param pMethod 
// @param start 
// @param pMessage 
// @param ... 
//============================================================

void FLoggerConsole::Output(TInt type, TLoggerLevel level, TAny* pSender, TCharC* pMethod, TDateTime start, TCharC* pMessage, va_list params){
 // 
 TFsText line = pMethod;
 TInt left = 0;
 if(line.StartsWith("static ")){
 left = 7;
 }
 if(line.StartsWith("virtual ")){
 left = 8;
 }
 left = MO_MAX(line.IndexOf(' ', left) + 1, 0);
 TInt right = line.IndexOf('(');
 if(-1 == right){
 right = line.Length();
 }
 TFsName method = line.SubPtrC(left, right);
 TInt spaceFlag = method.Find("MO::");
 if(ENotFound != spaceFlag){
 left = spaceFlag + 4;
 }else{
 left = 0;
 }
 TFsName name = method.SubPtrC(left, method.Length());
 // 
 TFsLogger logger;
 TDateTime current = RDateTime::Current();
 Format(logger, level, pSender, name.MemoryC(), start, current, pMessage, params);
 // 
#ifdef _WINDOWS
 OutputDebugString(logger.MemoryC());
#else
 printf("%s", logger.MemoryC());
#endif
 ILoggerWriter* pWriter = _pWriters[type];
 if(NULL != pWriter){
 pWriter->Write(logger, logger.Length());
 }
}

