 TInt index = pWriter->Code();
 MO_ASSERT_RANGE(index,0,MO_LOGGER_MAXCODE);
 _pWriters[index] = NULL;
}

//============================================================
// <T></T>
//
// @return 
//============================================================

TBool FLoggerWriter::Open(){
 if(!RFile::ExistPath(_path)){
 MO_DEBUG("log path(%s) is not exist.", (TCharC*)_path);
 return EFalse;
 }
 TBool ret = EFalse;
#ifdef _LINUX
 TInt logFileCount = 1;
 TFsDateTime fsDate = RDateTime::Current();
 TFsName pathPrefix;
 pathPrefix.Append(_path);
 pathPrefix.Append("/");
 pathPrefix.Append(_name);
 pathPrefix.Append("_");
 pathPrefix.Append(fsDate.Foramt("%y%m%d"));
 pathPrefix.Append("_");
 TFsName fullName;
 fullName.Append(pathPrefix);
 fullName.AppendFormat("%04d.log", logFileCount);
 // 000max
 if(RFile::ExistFile(fullName)){
 struct dirent* pDir;
 DIR* pDirBase = opendir(_path);
 while(NULL != (pDir = readdir(pDirBase))){
 if((strcmp(pDir->d_name, ".") == 0) || (strcmp(pDir->d_name,".."))) {
 continue;
 }
 TInt count = GetCountFromName(pDir->d_name);
 if(count > logFileCount){
 logFileCount = count;
 }
 }

 fullName.Clear();
 fullName.Append(pathPrefix);
 fullName.AppendFormat("%04d.log", logFileCount);
 struct stat st;
 if(stat(fullName.MemoryC(),&st)){
 MO_ERROR("Stat file:%s failed, errno:%d.", fullName.MemoryC(), errno);
 return EFalse;
 }else{
 if(st.st_size >= _capacity){ //
 logFileCount++;
 fullName.Clear();
 fullName.Append(pathPrefix);
 fullName.AppendFormat("%04d.log", logFileCount);
 }
 }
 }
 ret = _pStream->OpenAppend(fullName.MemoryC());
#endif
 return ret;
}

//============================================================
// <T></T>
//
// @return 
//============================================================

TBool FLoggerWriter::Create(){
 TInt count = GetCountFromName(_pStream->FileName());
 count++;
 TFsDateTime fsDate = RDateTime::Current();
 TFsName fullName;
 fullName.Append(_path);
 fullName.Append("/");
 fullName.Append(_name);
 fullName.Append("_");
 fullName.Append(fsDate.Foramt("%y%m%d"));
 fullName.Append("_");
 fullName.AppendFormat("%04d.log", count);
 _pStream->Close();
 _pStream->Open(fullName);
 return ETrue;
}

//============================================================
// <T></T>
//
// @param TCharC* pMessage 
// @param TSize length 
// @return 
//============================================================

TBool FLoggerWriter::Write(TCharC* pMessage, TSize length){
 TSize curSize = _pStream->Length();
 if(curSize + length > _capacity){
 Create();
 }
 if(length == _pStream->Write(pMessage,length)){
 return ETrue;
 }
 return EFalse;
}

//============================================================
// <T></T>
//
// @param TCharC* pName 
// @return 
//============================================================

TInt FLoggerWriter::GetCountFromName(TCharC* pName){
 TInt count = -1;
 TFsName name = pName;
 TInt offset1 = name.LastIndexOf('_');
 TInt offset2 = name.LastIndexOf('.');
 if(ENotFound != offset1 && offset2 > offset1){
 TFsName mid = name.SubPtrC(offset1 + 1, offset2);
 count = atoi(mid);
 }
 return count;
}

