 SMemoryEntry* pEntry = EntryAlloc();
 MO_ASSERT(pEntry);
 TByte* pMemory = (TByte*)MO_ALIGNED_ALLOC(size, sizeof(TInt));
 pEntry->SetTypeName(pTypeName);
 pEntry->SetFileInfo(pFileName, fileLine);
 pEntry->Link(pMemory, size);
 return pEntry->pMemory;
}

