//============================================================
// <T></T>
//
// @return
// <L value='ETrue'></L>
// <L value='EFalse'></L>
//============================================================

TBool FNetClientSocket::Connect(){
 // 
 TSocket handle = socket(PF_INET, SOCK_STREAM, IPPROTO_TCP);
 if(INVALID_SOCKET == handle){
 MO_PERROR(socket);
 return EFalse;
 }
 // 
 sockaddr_in address;
 address.sin_family = AF_INET;
 address.sin_port = htons(_info.port);
 address.sin_addr.s_addr = inet_addr(_host.MemoryC());
 memset(address.sin_zero, 0, sizeof(address.sin_zero));
 if(ESuccess != connect(handle, (struct sockaddr*)&address, sizeof(sockaddr_in))){
 MO_ERROR("Connect socket error. (host=%s, port=%d)", _host.MemoryC(), _info.port);
 MO_PERROR(connect);
 // 
#ifdef _WINDOWS
 if(ESuccess != closesocket(handle)){
 MO_PERROR(closesocket);
 }
#else
 if(ESuccess != close(handle)){
 MO_PERROR(close);
 }
#endif
 return EFalse;
 }
 _info.handle = handle;
 _isConnected = ETrue;
 return ETrue;
}

//============================================================

TBool FNetClientSocket::Connect(TCharC* pHost, TUint16 port){
 SetHost(pHost);
 SetPort(port);
 return Connect();
}

//============================================================
// <T></T>
//
// @return
// <L value='ETrue'></L>
// <L value='EFalse'></L>
//============================================================

TBool FNetClientSocket::Disconnect(){
 if(INVALID_SOCKET == _info.handle){
#ifdef _WINDOWS
 closesocket(_info.handle);
#else
 close(_info.handle);
#endif
 _info.handle = INVALID_SOCKET;
 return ETrue;
 }
 return EFalse;
}

//============================================================
// <T></T>
//
// @param pSocket 
// @param flag 
// @return
// <L value='ETrue'></L>
// <L value='EFalse'></L>
//============================================================

TBool FNetEpoll::Add(INetSocket* pSocket, TUint flag){
 MO_ASSERT(pSocket);
#ifdef _LINUX
 TInt handle = pSocket->Handle();
 epoll_event event;
 event.events = flag;
 event.data.fd = handle;
 TInt result = epoll_ctl(_handle, EPOLL_CTL_ADD, handle, &event);
 if(EError == result){
 MO_PERROR(epoll_ctl);
 return EFalse;
 }
