// <L value='EFalse'></L>
//============================================================

TBool FNetServerSocket::Bind(){
 // 
 _info.handle = socket(AF_INET, SOCK_STREAM, IPPROTO_TCP);
 if(INVALID_SOCKET == _info.handle){
 MO_PERROR(socket);
 return EFalse;
 }
 // 
 sockaddr_in address;
 address.sin_family = AF_INET;
 address.sin_addr.s_addr = htonl(INADDR_ANY);
 address.sin_port = htons(_info.port);
 memset(address.sin_zero, 0, sizeof(address.sin_zero));
 TInt result = bind(_info.handle, (struct sockaddr*)&address, sizeof(sockaddr_in));
 if(SOCKET_ERROR == result){
 MO_ERROR("Server socket bind failure. (host=%s, port=%d)", _host.MemoryC(), _info.port);
 MO_PFATAL(socket);
 return EFalse;
 }
 MO_DEBUG("Server socket bind success. (host=%s, port=%d)", _host.MemoryC(), _info.port);
 return ETrue;
}

