TBool FNetServerSocket::Listen(){
 TInt result = listen(_info.handle, SOMAXCONN);
 if(SOCKET_ERROR == result){
 MO_PERROR(socket);
 return EFalse;
 }
 MO_DEBUG("Server socket listen success. (host=%s, port=%d)", _host.MemoryC(), _info.port);
 return ETrue;
}

