TBool FNetServerSocket::Accept(SNetSocketInfo& info){
 sockaddr_in address;
#ifdef _WINDOWS
 TInt size = sizeof(struct sockaddr_in);
 TSocket socket = accept(_info.handle, (struct sockaddr*)&address, &size);
#else
 TUint32 size = sizeof(struct sockaddr_in);
 TSocket socket = accept(_info.handle, (struct sockaddr*)&address, &size);
#endif
 if(SOCKET_ERROR != socket){
 info.handle = socket;
 info.port = address.sin_port;
#ifdef _WINDOWS
 strcpy_s(info.host, sizeof(info.host), inet_ntoa(address.sin_addr));
#else
 strcpy(info.host, inet_ntoa(address.sin_addr));
#endif
 info.sourceIp = address.sin_addr.s_addr;
 return ETrue;
 }
 return EFalse;
}

