void FPipe::InnerGetInfo(TByte** ppMemory, TUint32& capacity, TUint32& length, TUint32& first, TUint32& last){
 *ppMemory = _pMemory;
 capacity = _info.capacity;
 first = _info.first;
 last = _info.last;
 length = (first <= last) ? last - first : (capacity - first) + last;
}

