inline void InnerInitialize(TInt size){
 MSet<FSet<N, V>, N, V>::InnerInitialize();
 // 
 this->_entryCount = MO_MAX(size, MO_OBJECT_CAPACITY);
 this->_ppEntries = RTypeMemory<SEntry*>::Alloc(this->_entryCount, NULL);
 this->_pUnused = NULL;
 }

inline SEntry* EntryCreate(){
 EnsureSize(this->_count + 1);
 return MO_MEM_CREATE(SEntry);
 }

void operator=(const MSetC<N, V>& set){
 this->Assign(&set);
 }

void EnsureSize(TInt size){
 if (size > (this->_entryCount << 3)) {
 // 
 size = this->_entryCount + (MO_MAX(this->_entryCount, size) >> 1);
 // 8
 SEntry** ppEntries = RTypeMemory<SEntry*>::Alloc(size, NULL);
 EntriesResize(ppEntries, size);
 // 
 RTypeMemory<SEntry*>::Free(this->_ppEntries);
 // 
 this->_ppEntries = ppEntries;
 this->_entryCount = size;
 }
 }

