void FSharedPipe::OnSharedLink(TShareSegment& segment){
 // 
 _gInfo = segment.TypeAlloc<SPipeInfo>();
 // 
 _gData = (TByte*)segment.Alloc(_capacity);
}

//============================================================
// <T></T>
//
// @param pMemory 
// @param capacity 
// @param length 
// @param first 
// @param last 
// @return 
//============================================================

void FSharedPipe::InnerGetInfo(TByte** ppMemory, TUint32& capacity, TUint32& length, TUint32& first, TUint32& last){
 MO_ASSERT(_gData);
 MO_ASSERT(_gInfo->capacity > 0);
 *ppMemory = _gData;
 capacity = _gInfo->capacity;
 first = _gInfo->first;
 last = _gInfo->last;
 length = (first <= last) ? last - first : (capacity - first) + last;
}

//============================================================
// <T></T>
//
// @return 
//============================================================

TInt FSharedPipe::Length(){
 TInt first = _gInfo->first;
 TInt last = _gInfo->last;
 TInt length = (first <= last) ? last - first : (_gInfo->capacity - first) + last;
 return length;
}

//============================================================
// <T></T>
//
// @return 
//============================================================

TInt FSharedPipe::Reamin(){
 TInt first = _gInfo->first;
 TInt last = _gInfo->last;
 TInt length = (first <= last) ? last - first : (_gInfo->capacity - first) + last;
 return _gInfo->capacity - length - MO_PIPE_RESERVE_LENGTH;
}

//============================================================
// <T></T>
// <P></P>
//    
// </P>
//============================================================

TBool FSharedQueue::Push(TAnyC* pData, TSize capacity){
   // 
   MO_ASSERT(pData);
   if(0 == capacity){
      return ETrue;
   }
   // 
   TByte* pMemory;
   TUint32 total, length, first, last;
   InnerGetInfo(&pMemory, total, length, first, last);
   // 
   if(capacity > (total - length - MO_PIPE_RESERVE_LENGTH)){
      return EFalse;
   }
   TSize size = *(TSize*)pData;
   if(size != capacity){
      MO_FATAL("Push data invalid. (size=%d, capacity=%d, length=%d, first=%d, last=%d)",
            size, capacity, length, first, last);
   }
   //  [---F===L----] | [===L---F====]
   TUint32 moved = (first < last) ? MO_MIN(capacity, total - last) : capacity;
   memcpy(pMemory + last, pData, moved);
   last += moved;
   // 
   if(capacity > moved){
      last = capacity - moved;
      memcpy(pMemory, (TByte*)pData + moved, last);
   }
   // 
   _gInfo->last = last;
   return ETrue;
}

//============================================================

TInt FSharedQueue::Pop(TAny* pData, TSize capacity){
 // 
 MO_ASSERT(pData);
 if(0 == capacity){
 return 0;
 }
 // 
 TByte* pMemory;
 TUint32 total, length, first, last;
 InnerGetInfo(&pMemory, total, length, first, last);
 // 
 if(length < sizeof(TUint32)){
 return 0;
 }
 TUint32 size = *(TUint32*)(pMemory + first);
 if(0 == size){
 MO_FATAL("Pop data length is 0. (size=%d, length=%d, first=%d, last=%d)",
 size, length, first, last);
 }
 if((size > capacity) || (size > length)){
 return 0;
 }
 // [---F===L----] | [===L---F====]
 TUint32 moved = (first < last) ? size : MO_MIN(size, total - first);
 memcpy(pData, pMemory + first, moved);
 // 
 if(size > moved){
 memcpy((TByte*)pData + moved, pMemory, size - moved);
 first = size - moved;
 }else{
 first += moved;
 }
 // 
 _gInfo->first = first;
 return size;
}

//============================================================
// <T></T>
// <P>
//    
//    
//    - 
//    - 
// </P>
//============================================================

TBool FSharedQueue::BlockPush(TAnyC* pData, TSize capacity){
   // 
   MO_ASSERT(pData);
   if(0 == capacity){
      return ETrue;
   }
   // 
   TByte* pMemory;
   TUint32 total, length, first, last;
   InnerGetInfo(&pMemory, total, length, first, last);
   // 
   if(capacity > (total - length - MO_PIPE_RESERVE_LENGTH)){
      return EFalse;
   }
   // 
   TByte* pPtr = NULL;
   TUint32 writed = sizeof(TUint32) + capacity;
   // 
   if(first < last){
      //  [---F===L----]
      if(writed < total - last){
         // 
         pPtr = pMemory + last;
         last += writed;
      }else if(writed < first){
         // 
         pPtr = pMemory;
         last = writed;
      }else{
         // 
         return EFalse;
      }
   }else{
      //  [===L---F====]
      pPtr = pMemory + last;
      last += writed;
   }
   // 
   *(TUint32*)pPtr = capacity;
   // 
   memcpy(pPtr + sizeof(TUint32), pData, capacity);
   // 
   _gInfo->last = last;
   return ETrue;
}

//============================================================
// <T></T>
// <P>
//    
//    
//    - 
// </P>
// TODO: 
//============================================================

TInt FSharedQueue::BlockPop(TAny* pData, TSize capacity){
   MO_ASSERT(pData);
   // 
   TByte* pMemory;
   TUint32 total, length, first, last;
   InnerGetInfo(&pMemory, total, length, first, last);
   // 
   if(length < sizeof(TInt)){
      return 0;
   }
   TUint32 size = *(TUint32*)(pMemory + first);
   if((size > capacity) || (size > length)){
      return 0;
   }
   //  [---F===L----] | [===L---F====]
   TUint32 moved = (first < last) ? size : MO_MIN(size, total - first);
   memcpy(pData, pMemory + first, moved);
   // 
   if(size > moved){
      memcpy((TByte*)pData + moved, pMemory, size - moved);
      first = size - moved;
   }else{
      first += moved;
   }
   // 
   _gInfo->first = first;
   return size;
}

