inline void InnerInitialize(TInt size){
 this->_length = 0;
 this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
 this->_pMemory = RTypeMemory<TChar16>::Alloc(this->_size, 0);
 }

//============================================================
// <T></T>
// <P>
// 1.5
// </P>
//
// @param size 
//============================================================

void FString16::EnsureSize(TInt size){
   if(size > this->_size){
      // 1.5<C>MO_MEMORY_CAPACITY</C>
      this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
      this->_size += this->_size >> 1;
      TChar16* pMemory = RTypeMemory<TChar16>::Alloc(this->_size, 0);
      if(this->_length > 0){
         RTypes<TChar16>::Copy(pMemory, this->_pMemory, this->_length);
      }
      RTypeMemory<TChar16>::Free(this->_pMemory);
      this->_pMemory = pMemory;
   }
}

