//============================================================

void FThread::Start(){
#ifdef _WINDOWS
 MO_ASSERT(NULL == _handle);
 // 
 _handle = CreateThread(NULL, 0, __MO_THREAD_CALLBACK, this, CREATE_SUSPENDED, &_threadId);
 MO_ASSERT(_handle);
 // 
 RThreadManager::Instance().Register(this);
 // 
 ResumeThread(_handle);
#else
 TInt result = pthread_create(&_handle, NULL, __MO_THREAD_CALLBACK, this);
 if(ESuccess != result){
 MO_PFATAL("pthread_create");
 }
#endif
}

//============================================================
// <T></T>
//============================================================

void FThread::Suspend(){
 MO_ASSERT(_handle);
 MO_DEBUG("Thread suspend begin.(thread=0x%08X)", this);
#ifdef _WINDOWS
 SuspendThread(_handle);
#else
 pthread_mutex_lock(&_mutex);
 pthread_cond_wait(&_condition, &_mutex);
 pthread_mutex_unlock(&_mutex);
#endif
 MO_DEBUG("Thread suspend end.(thread=0x%08X)", this);
}

//============================================================
// <T></T>
//============================================================

void FThread::Resume(){
 MO_ASSERT(_handle);
 MO_DEBUG("Thread resume begin.(thread=0x%08X)", this);
#ifdef _WINDOWS
 ResumeThread(_handle);
#else
 pthread_mutex_lock(&_mutex);
 pthread_cond_signal(&_condition);
 pthread_mutex_unlock(&_mutex);
#endif
 MO_DEBUG("Thread resume end.(thread=0x%08X)", this);
}

//============================================================
// <T></T>
//============================================================

void FThread::Join(IThread* pThread){
#ifdef _WINDOWS
 MO_ASSERT(_handle);
 WaitForSingleObject(pThread->Handle(), INFINITE);
#else
 TAny* pResult;
 pthread_join(pThread->Handle(), (TAny**)&pResult);
#endif
}

//============================================================
// <T></T>
//============================================================

TAny* FThread::Wait(){
 MO_ASSERT(_handle);
 TAny* pResult = NULL;
#ifdef _WINDOWS
 WaitForSingleObject(_handle, INFINITE);
#else
 pthread_join(_handle, (TAny**)&pResult);
#endif
 return pResult;
}

//============================================================
// <T></T>
//
// @param pThread 
//============================================================

void FThreadConsole::Register(FThread* pThread){
 MO_ASSERT(pThread);
 // 
 TThreadId threadId = pThread->ThreadId();
 // 
 _section.Enter();
 if(_pThreads->Contains(threadId)){
 MO_THROW("Thread id duplicate.");
 }
 // 
 _pThreads->Set(threadId, pThread);
 pThread->SetIndex(++_index);
 _section.Leave();
}

//============================================================
// <T></T>
//
// @param pThread 
//============================================================

void FThreadConsole::Unregister(FThread* pThread){
 MO_ASSERT(pThread);
 TThreadId threadId = pThread->ThreadId();
 // 
 if(!_pThreads->Contains(threadId)){
 MO_THROW("Thread id is not founded.");
 }
 _section.Enter();
 _pThreads->Remove(threadId);
 _section.Leave();
}

