//============================================================

TInt FThreadMemoryTrackThread::Process(){
 TUint used, total;
 while(!_stop){
 if(RAllocator::CalculateStatistics(used, total)){
 //MO_TRACK("Memory track: used=%0.3fM, total=%0.3fM", used/1024.0/1024.0, total/1024.0/1024.0);
 }
#ifdef _WINDOWS
 ::Sleep(2000);
#else
 sleep(2);
#endif
 }
 return ESuccess;
}

//============================================================

TInt FThreadPool::SleepCount(){
 return _pUnusedWorks->Count();
}

//============================================================

void FThreadPool::NotifyFree(FThreadWorker& worker){
 _section.Enter();
 _pUsedWorks->Remove(&worker);
 _pUnusedWorks->Push(&worker);
 _section.Leave();
 MO_DEBUG("Process thread (active=%d, sleep=%d)", _pUsedWorks->Count(), _pUnusedWorks->Count());
}

//============================================================

void FThreadPool::NotifyTimeout(FThreadWorker& worker){
}

//============================================================
// <T></T>
//
// @param runable 
//============================================================

void FThreadPool::Process(CRunable runable){
 FThreadWorker* pWorker = NULL;
 _section.Enter();
 if(_pUnusedWorks->IsEmpty()){
 pWorker = MO_CREATE(FThreadWorker, this);
 pWorker->Start();
 _pUsedWorks->Push(pWorker);
 }else{
 pWorker = _pUnusedWorks->Shift();
 }
 pWorker->SetRunable(runable);
 _pUsedWorks->Push(pWorker);
 pWorker->Resume();
 _section.Leave();
}

