 if(NULL == _pUnused){
 pTrap = new FTrap();
 }else{
 pTrap = _pUnused;
 _pUnused = pTrap->Parent();
 }
 // 
 pTrap->SetParent(_pUsed);
 _pUsed = pTrap;
}

//============================================================
// <T></T>
//
// @param pClassName 
// @param size 
// @param pFileName 
// @param line 
// @return 
//============================================================

TAny* FTrap::Alloc(TChar8C* pClassName, TInt size, TChar8C* pFileName, TInt line){
 // 
 FTrapBlock* pBlock = new FTrapBlock();
 pBlock->pClassName = pClassName;
 pBlock->pMemory = RMemory::Alloc(size);
 pBlock->Size = size;
 pBlock->pFileName = pFileName;
 pBlock->Line = line;
 // 
 _pBlocks->Set((TInt)pBlock->pMemory, pBlock);
 return pBlock->pMemory;
}

//============================================================
// <T></T>
//
// @param pMemory 
//============================================================

void FTrap::Remove(TAny* pMemory){
 FTrapBlock* pBlock = _pBlocks->Get((TInt)pMemory);
 if(NULL != pBlock){
 _pBlocks->Set((TInt)pMemory, NULL);
 MO_PTR_DELETE(pBlock);
 }
}

//============================================================
// <T></T>
//
// @param pMemory 
//============================================================

void FTrap::Free(TAny* pMemory){
 FTrapBlock* pBlock = _pBlocks->Get((TInt)pMemory);
 if(NULL != pBlock){
 _pBlocks->Set((TInt)pMemory, NULL);
 MO_PTR_DELETE(pBlock);
 }
 RMemory::Free(pMemory);
}

//============================================================
// <T></T>
// <P></P>
//============================================================

void FTrap::Check(){
   if(!_pBlocks->IsEmpty()){
      // 
      TBool hasLeak = EFalse;
      TSetIteratorC<TInt, FTrapBlock*> iterator = _pBlocks->IteratorC();
      while(iterator.Next()){
         FTrapBlock* pBlock = iterator.Value();
         if(NULL != pBlock){
            hasLeak = ETrue;
            MO_FATAL("Memory leak. (instance=%s@0x%08X, size=%08d, file=%s(%d))",
                  TFsName(pBlock->pClassName).MemoryC(), pBlock->pMemory, pBlock->Size, TFsFileName(pBlock->pFileName).MemoryC(), pBlock->Line);
         }
      }
      // 
      if(hasLeak){
         throw EError_NoMemory;
      }
   }
}

void operator=(const MTreeC<N, V>& tree){
 this->Assign(tree);
 }

inline void InnerInitialize(TInt size){
 // <C>MO_MEMORY_CAPACITY</C>
 this->_count = 0;
 this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
 this->_pMemory = RTypeMemory<T>::Alloc(this->_size, NULL);
 }

void operator=(const MPtrC<T>& ptr){
 Assign(ptr.MemoryC(), ptr.Length());
 }

void operator=(const MVectorC<T>& values){
 Assign(values.MemoryC(), values.Count());
 }

void operator=(const FVector<T>& values){
 Assign(values.MemoryC(), values.Count());
 }

void EnsureSize(TInt size){
 if(size > this->_size){
 // 1.5<C>MO_MEMORY_CAPACITY</C>
 this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
 this->_size += this->_size >> 1;
 T* pMemory = RTypeMemory<T>::Alloc(this->_size, NULL);
 if(this->_count > 0){
 RTypes<T>::Copy(pMemory, this->_pMemory, this->_count);
 }
 RTypeMemory<T>::Free(this->_pMemory);
 this->_pMemory = pMemory;
 }
 }

