//============================================================
// <T>XML</T>
//
// @param xml 
// @param pNode 
// @param level 
//============================================================

void FXmlNode::InnerBuildXml(TString& xml, FXmlNode* pNode, TInt level){
 xml.AppendRepeat(" ", level);
 if(EXmlNodeType_Comment == pNode->NodeType()){
 // 
 xml.Append("<--");
 xml.Append(pNode->Text());
 xml.Append("-->
");
 }else{
 // 
 xml.Append('<');
 xml.Append(pNode->Name());
 if(pNode->HasAttribute()){
 xml.Append(' ');
 TAttributesIteratorC iterator = pNode->Attributes()->IteratorC();
 while(iterator.Next()){
 xml.Append(iterator.Name());
 xml.Append("="");
 RXml::MakeNodeAttribute(xml, iterator.Value());
 xml.Append('"');
 if(iterator.HasNext()){
 xml.Append(' ');
 }
 }
 }
 if(pNode->HasNode()){
 xml.Append(">
");
 // 
 TListIteratorC<FXmlNode*> iterator = pNode->Nodes()->IteratorC();
 while(iterator.Next()){
 InnerBuildXml(xml, iterator.Get(), level + 1);
 }
 // 
 xml.AppendRepeat(" ", level);
 xml.Append("</");
 xml.Append(pNode->Name());
 xml.Append(">
");
 }else if(pNode->HasText()){
 xml.Append(">");
 RXml::MakeNodeText(xml, pNode->Text());
 xml.Append("</");
 xml.Append(pNode->Name());
 xml.Append(">
");
 }else{
 xml.Append("/>
");
 }
 }
}

