inline A* InnerCast(){
 return static_cast<A*>(this);
 }

T& operator[](TInt index){
 MO_ASSERT_RANGE(index, 0, this->_length);
 return this->_pMemory[index];
 }

void operator+=(T value){
 Push(value);
 }

void operator+=(const MPtrC<T>& ptr){
 Append(ptr.MemoryC(), ptr.Length());
 }

operator T*(){
 return this->_pMemory;
 }

T* Memory(){
 return this->_pMemory;
 }

TPtr<T> Ptr() const{
 return TPtr<T>(this->_pMemory, this->_length, this->_size);
 }

void Assign(const T* pValues, TInt length){
 InnerCast()->A::EnsureSize(length);
 this->_length = length;
 RTypes<T>::Copy(this->_pMemory, pValues, length);
 }

void Assign(const MPtrC<T>& ptr){
 Assign(ptr.MemoryC(), ptr.Length());
 }

void Append(const T* pValues, TInt length){
 InnerCast()->A::EnsureSize(this->_length + length);
 RTypes<T>::Copy(this->_pMemory + this->_length, pValues, length);
 this->_length += length;
 }

void Append(const MPtrC<T>& ptr){
 Append(ptr.MemoryC(), ptr.Length());
 }

T Shift(){
 MO_ASSERT(this->_length);
 T value = this->_pMemory[0];
 this->_length--;
 if(this->_length > 0){
 RTypes<T>::Move(this->_pMemory, this->_pMemory + 1, this->_length);
 }
 return value;
 }

void Unshift(T value){
 InnerCast()->A::EnsureSize(this->_length + 1);
 if(this->_length > 0){
 RTypes<T>::Move(this->_pMemory + 1, this->_pMemory, this->_length);
 }
 this->_pMemory[0] = value;
 this->_length++;
 }

T Pop(){
 MO_ASSERT(this->_length);
 return this->_pMemory[--this->_length];
 }

void Push(T value){
 InnerCast()->A::EnsureSize(this->_length + 1);
 this->_pMemory[this->_length++] = value;
 }

void Insert(TInt index, T value){
 MO_ASSERT_BETWEEN(index, 0, this->_length);
 InnerCast()->A::EnsureSize(this->_length + 1);
 RTypes<T>::Move(this->_pMemory + index + 1, this->_pMemory + index, this->_length - index);
 this->_pMemory[index] = value;
 this->_length++;
 }

void Insert(TInt index, const T* pValues, TInt length){
 MO_ASSERT_BETWEEN(index, 0, this->_length);
 InnerCast()->A::EnsureSize(this->_length + length);
 RTypes<T>::Move(this->_pMemory + index + length, this->_pMemory + index, this->_length - index);
 RTypes<T>::Copy(this->_pMemory + index, pValues, length);
 this->_length += length;
 }

void Insert(TInt index, const MPtrC<T>& ptr){
 Insert(index, ptr.MemoryC(), ptr.Length());
 }

void Fill(T value){
 RTypes<T>::Fill(this->_pMemory, this->_length, value);
 }

void Fill(T value, TInt length){
 MO_ASSERT_RANGE(length, 0, length)
 RTypes<T>::Fill(this->_pMemory, length, value);
 }

void Fill(T value, TInt offset, TInt length){
 MO_ASSERT_RANGE(length, 0, this->_length - offset)
 RTypes<T>::Fill(this->_pMemory + offset, length, value);
 }

void Replace(T source, T target){
 RTypes<T>::Replace(this->_pMemory, this->_length, source, target);
 }

void Replace(const MPtrC<T>& source, const MPtrC<T>& target){
 TInt position = 0;
 TInt pos = RTypes<T>::Find(this->_pMemory, this->_length, source.MemoryC(), source.Length());
 if(ENotFound != pos){
 TInt n = target.Length() - source.Length();
 TInt max = MO_MAX(target.Length(), source.Length());
 while(ENotFound != pos){
 if(n < 0){
 position += pos + max;
 RTypes<T>::Copy(this->_pMemory + position, target.MemoryC(), target.Length());
 RTypes<T>::Move(this->_pMemory + position + source.Length(), this->_pMemory + position + target.Length(), this->_length - position - source.Length());
 }else if(n > 0){
 InnerCast()->A::EnsureSize(this->_length + n);
 RTypes<T>::Move(this->_pMemory + position + source.Length(), this->_pMemory + position + target.Length(), this->_length - position - source.Length());
 RTypes<T>::Copy(this->_pMemory + position, target.MemoryC(), target.Length());
 }
 this->_length += n;
 }
 }
 }

void Swap(TInt from, TInt to){
 MO_ASSERT_RANGE(from, 0, this->_length);
 MO_ASSERT_RANGE(to, 0, this->_length);
 if(from != to){
 T value = this->_pMemory[from];
 this->_pMemory[from] = this->_pMemory[to];
 this->_pMemory[to] = value;
 }
 }

T Delete(TInt index){
 MO_ASSERT_RANGE(index, 0, this->_length);
 T value = this->_pMemory[index];
 if(index != this->_length - 1){
 RTypes<T>::Move(this->_pMemory + index, this->_pMemory + index + 1, this->_length - index);
 }
 this->_length--;
 return value;
 }

void Delete(TInt offset, TInt length){
 MO_ASSERT_RANGE(offset, 0, this->_length);
 MO_ASSERT_RANGE(length, 0, this->_length - offset);
 TInt count = this->_length - offset - length;
 if(count > 0){
 RTypes<T>::Move(this->_pMemory + offset, this->_pMemory + offset + length, MO_MIN(count, length));
 }
 this->_length -= length;
 }

void Remove(T value){
 TInt position = 0;
 TInt n = -1;
 while(++n < this->_length){
 if(this->_pMemory[n] != value){
 this->_pMemory[position++] = this->_pMemory[n];
 }
 }
 this->_length = position;
 }

void Set(TInt index, T value){
 MO_ASSERT_RANGE(index, 0, this->_length);
 this->_pMemory[index] = value;
 }

void SetLength(TInt length){
 InnerCast()->A::EnsureSize(length);
 if(length > this->_length){
 for(TInt n=this->_length; n<length; n++){
 this->_pMemory[n] = RType<T>::Default();
 }
 }
 this->_length = length;
 }

void Sort(IComparer<T>* pComparer){
 MO_ASSERT(pComparer)
 if(this->_pMemory && this->_length > 1){
 if(MO_COMPARRAY_THRESHOLD > this->_length) {
 RComparerSort<T>::InsertSort(this->_pMemory, 0, this->_length-1, pComparer);
 } else {
 RComparerSort<T>::QuickSort(this->_pMemory, 0, this->_length-1, pComparer);
 }
 }
 }

TInt BinarySearch(T data, IComparer<T>* pComparer) {
 MO_ASSERT(pComparer)
 if(this->_pMemory && this->_length > 0) {
 return RBinarySearch<T>::BinarySearch(
 this->_pMemory, 0, this->_length-1, data, pComparer);
 }
 return ENotFound;
 }

