//============================================================
// <T></T>
// 82</P>
//============================================================
void MAttributes::EnsureSize(TInt size){
   if(NULL == this->_ppEntries) {
      this->_entryCount = MO_MAX(size, MO_OBJECT_CAPACITY);
      // 
      this->_ppEntries = RTypeMemory<SEntry*>::Alloc(this->_entryCount, NULL);
   } else if (size > (this->_entryCount << 3)) {
      // 
      size = this->_entryCount + ((MO_MAX(this->_entryCount, size)) >> 1);
      // 8
      SAttributesEntry** ppEntries = RTypeMemory<SEntry*>::Alloc(size, NULL);
      // 
      SAttributesEntry* pEntry = this->_pFirst;
      while(NULL == pEntry){
         // 
         TInt index = pEntry->hash % size;
         pEntry->pLink = ppEntries[index];
         ppEntries[index] = pEntry;
            // 
         pEntry = pEntry->pLink;
      }
      // 
      RTypeMemory<SEntry*>::Free(this->_ppEntries);
      // 
      this->_ppEntries = ppEntries;
      this->_entryCount = size;
   }
}

