//============================================================
// <T></T>
//============================================================
void MAttributes::Set(TCharC* pName, TCharC* pValue){
   THashCode hash = RString::MakeHashCode(pName);
   TInt index = hash % this->_entryCount;
   // 
   SEntry* pEntry = this->_ppEntries[index];
   while(NULL != pEntry) {
      if(pEntry->hash == hash){
         if(pEntry->IsName(pName)){
            pEntry->pValue->Assign(pValue);
            return;
         }
      }
      pEntry = pEntry->pLink;
   }
   // 
   pEntry = MO_CREATE(SEntry);
   pEntry->hash = hash;
   pEntry->pLink = this->_ppEntries[index];
   pEntry->pName->Assign(pName);
   pEntry->pValue->Assign(pValue);
   this->_count++;
   this->_ppEntries[index] = pEntry;
   // 
   EntryPush(pEntry);
}

//============================================================
// <T></T>
//============================================================
TString MAttributes::Remove(TCharC* pName){
   THashCode hash = RString::MakeHashCode(pName);
   TInt index = hash % this->_entryCount;
   // 
   TString value;
   SAttributesEntry* pPrior = this->_ppEntries[index];
   SAttributesEntry* pEntry = pPrior;
   while(NULL != pEntry){
      if(pEntry->hash == hash){
         if(pEntry->IsName(pName)){
            value = *pEntry->pValue;
            if(pEntry == pPrior){
               // 
               this->_ppEntries[index] = pEntry->pLink;
            }else{
               // 
               pPrior->pLink = pEntry->pLink;
            }
            // 
            EntryRemove(pEntry);
            break;
         }
      }
      pPrior = pEntry;
      pEntry = pEntry->pLink;
   }
   return value;
}

