void Set(N name, V value){
 THashCode hash = MakeHashCode(name);
 TInt index = hash % this->_entryCount;
 // 
 SEntry* pEntry = this->_ppEntries[index];
 while(NULL != pEntry) {
 if(pEntry->Hash == hash){
 if(name->Equals(pEntry->name)){
 pEntry->value = value;
 return;
 }
 }
 pEntry = pEntry->Next;
 }
 // 
 pEntry = InnerCast()->A::EntryAlloc();
 pEntry->pLink = this->_ppEntries[index];
 pEntry->hash = hash;
 pEntry->name = name;
 pEntry->value = value;
 this->_ppEntries[index] = pEntry;
 // 
 EntryPush(pEntry);
 }

V Remove(N name){
 THashCode hash = MakeHashCode(name);
 TInt index = hash % this->_entryCount;
 // 
 V value = NULL;
 SEntry* pPrior = this->_ppEntries[index];
 SEntry* pEntry = pPrior;
 while(NULL != pEntry){
 if(pEntry->hash == hash){
 if(name->Equals(pEntry->name)){
 value = pEntry->value;
 if(pEntry == pPrior){
 // 
 this->_ppEntries[index] = pEntry->Next;
 }else{
 // 
 pPrior->Next = pEntry->Next;
 }
 // 
 EntryRemove(pEntry);
 break;
 }
 }
 pPrior = pEntry;
 pEntry = pEntry->Next;
 }
 return value;
 }

