TBool MMonitor::Test(TTimeSpan interval){
 TBool result = EFalse;
 if(_total < 0 || _count > 0){ // 
 _current -= interval;
 if( _current < 0 ){
 _current = _interval; // 
 --_count;
 result = ETrue;
 }

 }
 return result;
}

