//============================================================

TBool MMonitor::LoadConfig(FXmlNode* pConfig){
 TXmlNodeIteratorC iterator = pConfig->NodeIteratorC();
 while(iterator.Next()){
 if(iterator->IsName(MO_TAG_PROPERTY)){
 if(iterator->IsAttribute(MO_PTY_NAME, "delay")){
 // 
 TInt delay = iterator->TextAsInt();
 MO_DEBUG("Load monitor(%s) property. (delay=%dms)", (TCharC*)_name, delay);
 _delay = delay * 1000;
 }else if(iterator->IsAttribute(MO_PTY_NAME, "interval")){
 // 
 TInt interval = iterator->TextAsInt(MO_MONITOR_INTERVAL);
 MO_DEBUG("Load monitor(%s) property. (interval=%dms)", (TCharC*)_name, interval);
 _interval = interval * 1000;
 }else if(iterator->IsAttribute(MO_PTY_NAME, "total")){
 // 
 TInt total = iterator->TextAsInt();
 MO_DEBUG("Load monitor(%s) property. (total=%d)", (TCharC*)_name, total);
 SetTotal(total);
 }
 }
 }
 _current = (_delay > 0) ? _delay : _interval;
 return ETrue;
}

