 while(NULL != pFind){
 SEntry* pNext = pFind;
 MO_DELETE(pFind);
 pFind = pNext;
 }
 }
 // 
 RTypeMemory<SEntry*>::Free(this->_ppEntries);
 }

inline void InnerInitialize(){
 MEntriesC<SEntry>::InnerInitialize();
 _entryCount = 0;
 _ppEntries = NULL;
 }

inline A* InnerCast(){
 return static_cast<A*>(this);
 }

inline void InnerInitialize(TInt size){
 MNcDictionaryC<T>::InnerInitialize();
 _pUnused = NULL;
 InnerCast()->A::EnsureSize(size);
 }

void InnerRelease(){
 A* pInstance = InnerCast();
 // 
 if(this->_count > 0){
 // 
 this->_pLast->pNext = this->_pUnused;
 this->_pUnused = this->_pFirst;
 // 
 SEntry* pFind = this->_pUnused;
 while(NULL != pFind){
 SEntry* pNext = pFind->pNext;
 pInstance->EntryRelease(pFind);
 pFind = pNext;
 }
 }
 // 
 pInstance->EntryFlatRelease(this->_ppEntries);
 }

inline SEntry* EntryAlloc(){
 SEntry* pEntry = NULL;
 // 
 if(NULL != this->_pUnused){
 // 
 pEntry = this->_pUnused;
 this->_pUnused = this->_pUnused->pNext;
 }else{
 // 
 pEntry = InnerCast()->A::EntryCreate();
 }
 return pEntry;
 }

inline void EntryFree(SEntry* pEntry){
 MO_ASSERT(pEntry);
 pEntry->pNext = this->_pUnused;
 this->_pUnused = pEntry;
 }

