inline void EntriesResize(SEntry** ppEntries, TInt size){
 // 
 TInt n = 0;
 while(++n < this->_entryCount){
 SEntry* pEntry = this->_ppEntries[n];
 while(NULL != pEntry){
 // 
 SEntry* pLink = pEntry->pLink;
 // 
 TInt index = pEntry->Hash() % size;
 pEntry->pLink = ppEntries[index];
 ppEntries[index] = pEntry;
 // 
 pEntry = pLink;
 }
 }
 }

