void Set(TCharC* pName, T value){
 THashCode hash = RString::MakeNocaseHashCode(pName);
 TInt index = hash % this->_entryCount;
 // 
 SEntry* pEntry = this->_ppEntries[index];
 while(NULL != pEntry) {
 if(pEntry->hash == hash){
 if(pEntry->IsNameIgnoreCase(pName)){
 pEntry->value = value;
 return;
 }
 }
 pEntry = pEntry->pNext;
 }
 // 
 pEntry = EntryAlloc();
 pEntry->pLink = this->_ppEntries[index];
 pEntry->hash = hash;
 pEntry->SetName(pName);
 pEntry->value = value;
 this->_ppEntries[index] = pEntry;
 // 
 EntryPush(pEntry);
 }

void Set(const MStringPtrC& name, T value){
 Set(name.MemoryC(), value);
 }

T Remove(TCharC* pName){
 THashCode hash = RString::MakeNocaseHashCode(pName);
 TInt index = hash % this->_entryCount;
 // 
 T value = NULL;
 SEntry* pPrior = this->_ppEntries[index];
 SEntry* pEntry = pPrior;
 while(NULL != pEntry){
 if(pEntry->hash == hash){
 if(pEntry->IsNameIgnoreCase(pName)){
 value = pEntry->value;
 if(pEntry == pPrior){
 // 
 this->_ppEntries[index] = pEntry->pNext;
 }else{
 // 
 pPrior->pNext = pEntry->pNext;
 }
 // 
 EntryRemove(pEntry);
 break;
 }
 }
 pPrior = pEntry;
 pEntry = pEntry->pNext;
 }
 return value;
 }

T Remove(const MStringPtrC& name){
 return Remove(name.MemoryC());
 }

