 while(iterator.Next()){
 SEntry* pEntry = this->EntryFind(iterator.Name());
 if(NULL == pEntry){
 return EFalse;
 }
 if(!iterator.IsValue(pEntry->value)){
 return EFalse;
 }
 }
 return ETrue;
 }

