operator T*() const{
 return this->_pMemory;
 }

T* Memory() const{
 return this->_pMemory;
 }

void EnsureSize(TInt size){
 if(NULL == this->_pMemory){
 // <C>MO_MEMORY_CAPACITY</C>
 this->_count = 0;
 this->_total = MO_MAX(size, MO_MEMORY_CAPACITY);
 this->_pMemory = RTypeMemory<T>::Alloc(_total, 0);
 }else if(size > _total){
 // 1.5<C>MO_MEMORY_CAPACITY</C>
 TInt total = MO_MAX(this->_total, size);
 this->_total = total + (total >> 1);
 T* pMemory = RTypeMemory<T>::Alloc(_total);
 if(this->_count > 0){
 RTypes<T>::Copy(this->_pMemory, pMemory, this->_count);
 }
 RTypeMemory<T>::Free(this->_pMemory);
 this->_pMemory = pMemory;
 }
 }

void Assign(MObjectsC<T>& source){
 EnsureSize(source.Count());
 this->_count = source.Count();
 RTypeMemory<T>::Copy(source.MemoryC(), this->_pMemory, this->_count);
 }

void Append(const T* pSource, TInt count){
 EnsureSize(this->_count + count);
 RTypeMemory<T>::Copy(pSource, this->_pMemory + this->_count, count);
 this->_count += count;
 }

void Append(MObjectsC<T>& source){
 Append(source.MemoryC(), source.Count());
 }

void Set(TInt index, T value){
 if(index >= 0 && index < this->_count){
 this->_pMemory[index] = value;
 }
 }

void SetCount(TInt count){
 EnsureSize(count);
 if(count > this->_count){
 for(TInt n=this->_count; n<count; n++){
 this->_pMemory[n] = RType<T>::Default();
 }
 }
 this->_count = count;
 }

TPtr<T> Ptr() const{
 return TPtr<T>(this->_pMemory, this->_count);
 }

void Insert(TInt index, T value){
 MO_ASSERT_RANGE(index, 0, this->_count + 1);
 EnsureSize(this->_count + 1);
 RTypeMemory<T>::Copy(this->_pMemory + index, this->_pMemory + index + 1, this->_count - index);
 this->_pMemory[index] = value;
 this->_count++;
 }

void Insert(TInt index, const T* pSource, TInt length){
 MO_ASSERT_RANGE(index, 0, this->_count + 1);
 EnsureSize(this->_count + length);
 RTypeMemory<T>::Copy(this->_pMemory + index, this->_pMemory + index + length, this->_count - index);
 RTypeMemory<T>::Copy(pSource, this->_pMemory + index, length);
 this->_count += length;
 }

void Insert(TInt index, MArrayC<T>& source){
 MO_ASSERT_RANGE(index, 0, this->_count + 1);
 TInt length = source.Length();
 EnsureSize(this->_count + length);
 RTypeMemory<T>::Copy(this->_pMemory + index, this->_pMemory + index + length, this->_count - index);
 RTypeMemory<T>::Copy(source.MemoryC(), this->_pMemory + index, length);
 this->_count += length;
 }

void Push(T source){
 EnsureSize(this->_count + 1);
 this->_pMemory[this->_count++] = source;
 }

void Swap(TInt from, TInt to){
 if((from >= 0) && (from < this->_count) && (to >= 0) && (to < this->_count) && (from != to)){
 T value = this->_pMemory[from];
 this->_pMemory[from] = this->_pMemory[to];
 this->_pMemory[to] = value;
 }
 }

void Delete(TInt index){
 MO_ASSERT_RANGE(index, 0, this->_count);
 if(index != this->_count - 1){
 RTypeMemory<T>::Copy(this->_pMemory + index + 1, this->_pMemory + index, this->_count - index);
 }
 this->_count--;
 }

void Delete(TInt offset, TInt length){
 MO_ASSERT_RANGE(offset, 0, this->_count);
 MO_ASSERT_RANGE(length, 0, this->_count - offset);
 TInt count = this->_count - offset - length;
 if(count > 0){
 RTypeMemory<T>::Copy(this->_pMemory + offset + length, this->_pMemory + offset, MO_MIN(count, length));
 }
 this->_count -= length;
 }

void Remove(T value){
 TInt position = 0;
 for(TInt n=0; n<this->_count; n++){
 if(this->_pMemory[n] != value){
 this->_pMemory[position++] = this->_pMemory[n];
 }
 }
 this->_count = position;
 }

void Compress(){
 TInt count = 0;
 for(TInt n = 0; n<this->_count; n++){
 if(NULL != this->_pMemory[n]){
 this->_pMemory[count++] = this->_pMemory[n];
 }
 }
 if(count > 0){
 T* pMemory = RTypeMemory<T>::Alloc(count);
 RTypeMemory<T>::Copy(this->_pMemory, pMemory, count);
 RTypeMemory<T>::Free(this->_pMemory);
 this->_pMemory = pMemory;
 }else{
 RTypeMemory<T>::Free(this->_pMemory);
 this->_pMemory = NULL;
 }
 this->_count = count;
 this->_total = count;
 }

void Clear(){
 this->_count = 0;
 }

const T operator[](TInt index) const{
 return (index >= 0 && index < _count) ? _pMemory[index] : RType<T>::Default();
 }

TBool IsEmpty() const{
 return (0 == _count);
 }

