//============================================================
// <T></T>
//
// @return 
//============================================================

TInt MPipe::Peek(TAny* pData, TSize size){
 // 
 MO_ASSERT(pData);
 if(0 == size){
 return 0;
 }
 // 
 TByte* pMemory;
 TUint32 capacity, length, first, last;
 InnerGetInfo(&pMemory, capacity, length, first, last);
 // [---F===L----] | [===L---F====]
 TUint32 readed = MO_MIN(size, length);
 TUint32 copied = (first < last) ? readed : MO_MIN(readed, capacity - first);
 memcpy(pData, pMemory + first, copied);
 // 
 if(readed > copied){
 memcpy(pMemory, (TByte*)pData + copied, readed - copied);
 }
 // 
 return readed;
}

//============================================================
// <T></T>
//
// @return 
//============================================================

TInt MPipe::Write(TAnyC* pData, TSize capacity){
 // 
 MO_ASSERT(pData);
 if(0 == capacity){
 return 0;
 }
 // 
 TByte* pMemory;
 TUint32 total, length, first, last;
 InnerGetInfo(&pMemory, total, length, first, last);
 // [---F===L----] | [===L---F====]
 TUint32 writed = MO_MIN(capacity, total - length - MO_PIPE_RESERVE_LENGTH);
 TUint32 copied = (first < last) ? MO_MIN(writed, total - last) : writed;
 memcpy(pMemory + last, pData, copied);
 last += copied;
 // [===L---F====]
 if(writed > copied){
 memcpy(pMemory, (TByte*)pData + copied, writed - copied);
 last = writed - copied;
 }
 // 
 Info()->last = last;
 return writed;
}

//============================================================
// <T></T>
//
// @return 
//============================================================

TInt MPipe::Read(TAny* pData, TSize size){
 // 
 MO_ASSERT(pData);
 if(0 == size){
 return 0;
 }
 // 
 TByte* pMemory;
 TUint32 capacity, length, first, last;
 InnerGetInfo(&pMemory, capacity, length, first, last);
 // [---F===L----] | [===L---F====]
 TUint32 readed = MO_MIN(size, length);
 TUint32 copied = (first < last) ? readed : MO_MIN(readed, capacity - first);
 memcpy(pData, pMemory + first, copied);
 first += copied;
 // [===L---F====]
 if(readed > copied){
 memcpy(pMemory, (TByte*)pData + copied, readed - copied);
 first = readed - copied;
 }
 // 
 Info()->first = first;
 return readed;
}

//============================================================

TBool MPipe::TryWrite(TAnyC* pData, TSize capacity){
 // 
 MO_ASSERT(pData);
 if(0 == capacity){
 return ETrue;
 }
 // 
 TByte* pMemory;
 TUint32 total, length, first, last;
 InnerGetInfo(&pMemory, total, length, first, last);
 // 
 if(capacity > (total - length - MO_PIPE_RESERVE_LENGTH)){
 return EFalse;
 }
 // [---F===L----] | [===L---F====]
 TUint32 moved = (first < last) ? MO_MIN(capacity, total - last) : capacity;
 memcpy(pMemory + last, pData, moved);
 last += moved;
 // 
 if(capacity > moved){
 last = capacity - moved;
 memcpy(pMemory, (TByte*)pData + moved, last);
 }
 // 
 Info()->last = last;
 return ETrue;
}

//============================================================
// <T></T>
//============================================================

TInt MPipe::TryRead(TAny* pData, TSize capacity){
 // 
 MO_ASSERT(pData);
 if(0 == capacity){
 return 0;
 }
 // 
 TByte* pMemory;
 TUint32 total, length, first, last;
 InnerGetInfo(&pMemory, total, length, first, last);
 // 
 if(length < sizeof(TUint32)){
 return 0;
 }
 TUint32 size = *(TUint32*)(pMemory + first);
 if((size > capacity) || (size > length)){
 return 0;
 }
 // [---F===L----] | [===L---F====]
 TUint32 moved = (first < last) ? size : MO_MIN(size, total - first);
 memcpy(pData, pMemory + first, moved);
 // 
 if(size > moved){
 memcpy((TByte*)pData + moved, pMemory, size - moved);
 first = size - moved;
 }else{
 first += moved;
 }
 // 
 Info()->first = first;
 return ETrue;
}

//============================================================

