//============================================================

TInt MProperties8C::Pack(TChar8* pPack, TInt length){
 TInt nameLength, valueLength, nameLenLen, valueLenLen;
 if(pPack){
 TChar8* writePos = pPack;
 TInt bytesWrite = 0;
 char lengthString[16];
 for(TInt n = 0; n < _count; n++){
 TFsDump8 onePair;
 TChar8C* pName = _pNames->Get(n);
 TChar8C* pValue = _pValues->Get(n);
 nameLength = strlen(pName);
 valueLength = strlen(pValue);
 nameLenLen = RInt::CountDigit(nameLength);
 valueLenLen = RInt::CountDigit(valueLength);
 // 
 RRuntime::IntToString8(nameLenLen, lengthString, 16);
 onePair.Append(lengthString);
 // 
 RRuntime::IntToString8(nameLength, lengthString, 16);
 onePair.Append(lengthString);
 // 
 onePair.Append(pName);
 // 
 RRuntime::IntToString8(valueLenLen, lengthString, 16);
 onePair.Append(lengthString);
 // 
 RRuntime::IntToString8(valueLength, lengthString, 16);
 onePair.Append(lengthString);
 // 
 onePair.Append(pValue);
 TInt pairLen = onePair.Length();
 MO_LIB_MEMCPY(writePos,length - bytesWrite, onePair.MemoryC(), pairLen);
 //MO_LIB_STRCPY(writePos, length - bytesWrite, onePair.MemoryC());
 bytesWrite += pairLen;
 writePos+= pairLen;
 }
 return bytesWrite;
 }else{
 TInt byteCount = 0;
 for(TInt n = 0; n < _count; n++){
 nameLength = strlen(_pNames->Get(n));
 nameLenLen = RInt::CountDigit(nameLength);
 valueLength = strlen(_pValues->Get(n));
 valueLenLen = RInt::CountDigit(valueLength);
 byteCount += ( 1 + nameLenLen + nameLength + 1 + valueLenLen + valueLength);
 }
 return byteCount;
 }
}

