void Set(N code, V value){
 TInt index = code % this->_entryCount;
 // 
 SEntry* pEntry = this->_ppEntries[index];
 while(NULL != pEntry) {
 if(pEntry->code == code){
 pEntry->value = value;
 return;
 }
 pEntry = pEntry->pLink;
 }
 // 
 pEntry = EntryAlloc();
 pEntry->pLink = this->_ppEntries[index];
 pEntry->code = code;
 pEntry->value = value;
 this->_ppEntries[index] = pEntry;
 // 
 EntryPush(pEntry);
 }

V Remove(N code){
 TInt index = code % this->_entryCount;
 // 
 V value = NULL;
 SEntry* pPrior = this->_ppEntries[index];
 SEntry* pEntry = pPrior;
 while(NULL != pEntry){
 if(pEntry->code == code){
 value = pEntry->value;
 if(pEntry == pPrior){
 // 
 this->_ppEntries[index] = pEntry->pNext;
 }else{
 // 
 pPrior->pNext = pEntry->pNext;
 }
 // 
 EntryRemove(pEntry);
 break;
 }
 pPrior = pEntry;
 pEntry = pEntry->pLink;
 }
 return value;
 }

