 // 
 TIteratorC iterator = pSet->IteratorC();
 while(iterator.Next()){
 N code = iterator.Code();
 SEntry* pEntry = this->EntryFind(code);
 if(NULL == pEntry){
 return EFalse;
 }
 if(!iterator.IsValue(pEntry->value)){
 return EFalse;
 }
 }
 return ETrue;
 }

