MString16PtrC MString16C::TrimLeft() const{
 TInt position = 0;
 TInt length = Length();
 TChar16* pMemory = _pMemory;
 while((position < length) && (pMemory[position] <= ' ')){
 position++;
 }
 return TString16Ptr(pMemory + position, length - position);
}

//============================================================
// <T></T>
//
// @return 
//============================================================

MString16PtrC MString16C::TrimRight() const{
 TInt position = Length() - 1;
 TChar16* pMemory = _pMemory;
 while((position >= 0) && (pMemory[position] <= ' ')){
 position--;
 }
 return TString16Ptr(pMemory, position);
}

//============================================================
// <T></T>
//
// @return 
//============================================================

MString16PtrC MString16C::Trim() const{
 TInt start = 0;
 TInt length = Length();
 TChar16* pMemory = _pMemory;
 // 
 while((start < length) && (pMemory[start] <= ' ')){
 start++;
 }
 // 
 TInt end = length - 1;
 while((end >= 0) && (pMemory[end] <= ' ')){
 end--;
 }
 return TString16Ptr(pMemory + start, end - start + 1);
}

