 TString8Refer value(pValue);
 // 
 TInt begin = 0 ;
 TInt index = value.Find(pSplitter);
 while(ENotFound != index){
 Push(value.SubPtrC(begin, index));
 begin = index + length;
 index = value.Find(pSplitter, begin);
 }
}

