TInt MString8sC::Pack(TChar8* pPack, TInt length){
 TInt valueLen, valueLenLen, byteCount = 0;
 FString8* pString;
 for(TInt n = 0; n < _count; n++){
 pString = _pStrings->Get(n);
 valueLen = pString->Length();
 valueLenLen = RInt::CountDigit(valueLen);
 if(pPack){
 TChar8 buffer[16];
 RRuntime::IntToString8(valueLenLen, buffer, 16);
 pPack[byteCount++] = buffer[0];
 RRuntime::IntToString8(valueLen, buffer, 16);
 MO_LIB_MEMCPY(&pPack[byteCount], length - byteCount, buffer, valueLenLen);
 byteCount += valueLenLen;
 MO_LIB_MEMCPY(&pPack[byteCount], length - byteCount, pString->MemoryC(), valueLen);
 byteCount += valueLen;
 }else{
 byteCount += (1 + valueLenLen + valueLen);
 }
 }
 if(pPack){
 pPack[byteCount] = 0;
 }
 return byteCount;
}

TString8 MString8sC::Pack(){
 TString8 result;
 TInt valueLen, valueLenLen;
 FString8* pString;
 for(TInt n = 0; n < _count; n++){
 pString = _pStrings->Get(n);
 valueLen = pString->Length();
 valueLenLen = RInt::CountDigit(valueLen);
 TChar8 buffer[16];
 result.Append(RRuntime::IntToString8(valueLenLen, buffer, 16));
 result.Append(RRuntime::IntToString8(valueLen, buffer, 16));
 result.Append(pString->MemoryC());
 }
 return result;
}

inline void Initialize(TInt level){
 MTreeC<N, V>::Initialize(level);
 this->_level = level;
 this->_pRoot = EntryAlloc();
 }

SEntry* EntryAlloc(){
 SEntry* pEntry = this->_pUnused;
 if(NULL == pEntry){
 pEntry = new SEntry();
 }else{
 this->_pUnused = pEntry->pNext;
 }
 pEntry->exists = EFalse;
 EntryPush(pEntry);
 return pEntry;
 }

void EntryRelease(){
 SEntry* pEntry = this->_pFirst;
 while(NULL != pEntry){
 // 
 if(NULL != pEntry->ppNodes){
 RTypeMemory<SEntry*>::Free(pEntry->ppNodes);
 }
 // 
 SEntry* pNext = pEntry->pNext;
 delete pEntry;
 pEntry = pNext;
 }
 }

TIterator Iterator() const{
 return TIterator(this->_pFirst);
 }

void Assign(const MTreeC<N, V>& tree){
 Clear();
 Append(tree);
 }

void Append(const MTreeC<N, V>& tree){
 TTreeIteratorC<N, V> iterator = tree.IteratorC();
 while(iterator.Next()){
 Set(iterator.Code(), iterator.Value());
 }
 }

void Set(N code, V value){
 N find = code;
 SEntry* pFind = this->_pRoot;
 SEntry* pEntry = this->_pRoot;
 // 
 while(find > 0){
 TInt index = find % (1 << this->_level);
 find = find >> this->_level;
 // 
 if(NULL == pEntry->ppNodes){
 pEntry->ppNodes = RTypeMemory<SEntry*>::Alloc(1 << this->_level, 0);
 }
 // 
 pFind = pEntry->ppNodes[index];
 if(NULL == pFind){
 pFind = EntryAlloc();
 pEntry->ppNodes[index] = pFind;
 }
 pEntry = pFind;
 }
 // 
 pFind->exists = ETrue;
 pFind->code = code;
 pFind->value = value;
 }

void Remove(N code){
 SEntry* pEntry = EntryFind(code);
 MO_ASSERT(pEntry);
 // 
 pEntry->exists = EFalse;
 }

void Clear(){
 this->EntryClear();
 this->_pRoot = EntryAlloc();
 }

inline void Initialize(TInt level){
 MO_ASSERT(level > 1);
 MLinkedC::Initialize();
 _level = level;
 _pRoot = NULL;
 }

EBoolean operator==(const MTreeC<N, V>& tree) const{
 return Equals(tree);
 }

EBoolean operator!=(const MTreeC<N, V>& tree) const{
 return !Equals(tree);
 }

inline V operator[](N code) const{
 SEntry* pEntry = EntryFind(code);
 MO_ASSERT(pEntry);
 return pEntry->value;
 }

inline SEntry* EntryFind(N code) const{
 // 
 SEntry* pEntry = _pRoot;
 while(code > 0){
 pEntry = pEntry->ppNodes[code % (1<<_level)];
 if(NULL == pEntry){
 return NULL;
 }
 code = code >> _level;
 }
 return pEntry;
 }

inline void EntryClear(){
 // 
 SEntry* pEntry = this->_pFirst;
 while(NULL != pEntry){
 if(NULL != pEntry->ppNodes){
 RTypes<SEntry*>::Clear(pEntry->ppNodes, 1 << _level);
 }
 pEntry = pEntry->pNext;
 }
 // 
 MLinkedEntryC<SEntry*>::EntryClear();
 // 
 _pRoot = NULL;
 }

TInt Level() const{
 return _level;
 }

TBool Constains(N code) const{
 SEntry* pEntry = EntryFind(code);
 return (NULL != pEntry) ? pEntry->exists : EFalse;
 }

TBool Equals(const MTreeC<N, V>& tree) const{
 // 
 if(this->_count == tree._count){
 // 
 TIteratorC iterator = tree.IteratorC();
 while(iterator.Next()){
 SEntry* pEntry = EntryFind(iterator.Code());
 if(NULL == pEntry){
 return EFalse;
 }
 if(pEntry->value != iterator.value){
 return EFalse;
 }
 }
 return ETrue;
 }
 return EFalse;
 }

