void Replace(const MVectorC<T>& source, const MVectorC<T>& target){
 TInt position = 0;
 TInt pos = RTypes<T>::Find(this->_pMemory, this->_count, source.MemoryC(), source.Count());
 if(ENotFound != pos){
 TInt n = target.Count() - source.Count();
 TInt max = MO_MAX(target.Count(), source.Count());
 while(ENotFound != pos){
 if(n < 0){
 position += pos + max;
 RTypes<T>::Copy(this->_pMemory + position, target.MemoryC(), target.Count());
 RTypes<T>::Move(this->_pMemory + position + source.Count(), this->_pMemory + position + target.Count(), this->_count - position - source.Count());
 }else if(n > 0){
 InnerCast()->A::EnsureSize(this->_count + n);
 RTypes<T>::Move(this->_pMemory + position + source.Count(), this->_pMemory + position + target.Count(), this->_count - position - source.Count());
 RTypes<T>::Copy(this->_pMemory + position, target.MemoryC(), target.Count());
 }
 this->_count += n;
 }
 }
 }

void Swap(TInt from, TInt to){
 MO_ASSERT_RANGE(from, 0, this->_count);
 MO_ASSERT_RANGE(to, 0, this->_count);
 if(from != to){
 T value = this->_pMemory[from];
 this->_pMemory[from] = this->_pMemory[to];
 this->_pMemory[to] = value;
 }
 }

