 MO_ASSERT_RANGE(index, 0, this->_count);
 T value = this->_pMemory[index];
 if(index != this->_count - 1){
 RTypes<T>::Move(this->_pMemory + index, this->_pMemory + index + 1, this->_count - index);
 }
 this->_count--;
 return value;
 }

void Delete(TInt offset, TInt count){
 MO_ASSERT_RANGE(offset, 0, this->_count);
 MO_ASSERT_RANGE(count, 0, this->_count - offset);
 TInt last = this->_count - offset - count;
 if(last > 0){
 RTypes<T>::Move(this->_pMemory + offset, this->_pMemory + offset + count, MO_MIN(last, count));
 }
 this->_count -= count;
 }

