static TInt BinarySearch(T *pMemory, TInt b, TInt e, T data, IComparer<T>* pComparer){
 if(b < e) {
 TInt pvt = (b + e) / 2;
 TInt ret = pComparer->Compare(pMemory[pvt], data);
 if(ret > 0) {
 return BinarySearch(pMemory, b, pvt-1, data, pComparer);
 } else if(ret < 0) {
 return BinarySearch(pMemory, pvt+1, e, data, pComparer);
 } else {
 return pvt;
 }
 } else if(b == e) {
 if(pComparer->Compare(pMemory[b], data) == 0)
 return b;
 }
 return ENotFound;
 }

