//============================================================

TChar* RByte::Format(TByteC* pBytes, TInt count, TChar* pResult, TInt length){
 TInt n = -1;
 TChar* pWrite = pResult;
 while(++n < count){
 TUbyte byte = pBytes[n];
 // 
 if(n > 0){
 *pWrite++ = ' ';
 if(--length < 1){
 break;
 }
 }
 // 
 *pWrite++ = HEX_CHARS[byte >> 4];
 if(--length < 1){
 break;
 }
 // 
 *pWrite++ = HEX_CHARS[byte & 0x0F];
 if(--length < 1){
 break;
 }
 }
 // 
 *pWrite = 0;
 // 
 return pResult;
}

//============================================================
// <T></T>
//
// <P>:  </P>
// @param pBytes 
// @param count 
// @param columns 
// @param pResult 
// @param length  
// @return 
//============================================================

TChar* RByte::FormatMemory(TByteC* pBytes, TInt count, TInt columns, TChar* pResult, TInt length){
   TInt index = 0;
   TInt position = 0;
   TInt size = 18 + (4 * columns) + 4;
   while(length > size + 4){
      MO_LIB_SPRINTF(pResult + position, length - position, " - 0x%04" MO_FMT_HEX "(% 6" MO_FMT_INT "):", index, index);
      TChar* pWrite = pResult + position + 18;
      TChar* pChars = pWrite + (3 * columns);
      *pChars++ = ' ';
      *pChars++ = '[';
      for(int n = 0; n < columns; n++){
         *pWrite++ = ' ';
         if(index < count){
            TChar ch = pBytes[index++];
            TInt byte = (ch >= 0) ? ch : 0x100 + ch;
            *pWrite++ = HEX_CHARS[byte >> 4];
            *pWrite++ = HEX_CHARS[byte & 0x0F];
            *pChars++ = (byte >= 32 && byte < 127 ) ? byte : '.';
         }else{
            *pWrite++ = ' ';
            *pWrite++ = ' ';
            *pChars++ = ' ';
         }
      }
      *pChars++ = ']';
      if(index >= count){
         *pChars = 0;
         break;
      }
      length -= size;
      if(length < size + 4){
         MO_LIB_STRCPY(pChars, length - (pChars - pResult), " >>");
      }else{
         *pChars = '
';
      }
      position += size;
   }
   return pResult;
}

//============================================================
// <T></T>
//
// <P>:  </P>
// @param pBytes 
// @param count 
// @param pResult 
// @param length  
// @return 
//============================================================

TChar* RByte::Dump(TByteC* pBytes, TInt count, TChar* pResult, TInt length){
   return FormatMemory(pBytes, count, 16, pResult, length);
}

//============================================================
// <T></T>
//
// @param pSource 
// @param length 
//============================================================

void RChar8::ToLower(TChar8* pValues, TInt length){
 while(--length >= 0){
