static void InsertSort(T* pMemory, TInt b, TInt e,IComparer<T>* pComparer){
 if(b < e) {
 T tmp;
 for(TInt i = b + 1; i <= e; ++i) {
 for(TInt j = i; j > b; --j) {
 if(pComparer->Compare(pMemory[j], pMemory[j-1]) < 0){
 MO_SORT_SWAP(tmp, pMemory[j], pMemory[j-1]);
 } else{
 break;
 }
 }
 }
 }
 }

static void QuickSort(T* pMemory, TInt b, TInt e, IComparer<T>* pComparer){
 if(b < e) {
 T tmp;
 TInt pivot = (b + e) / 2;
 T data = pMemory[pivot];
 MO_SORT_SWAP(tmp, pMemory[b], pMemory[pivot]);
 TInt last = b;

 for(TInt i = b+1; i <= e; ++i) {
 if(pComparer->Compare(pMemory[i], data) < 0) {
 ++last;
 MO_SORT_SWAP(tmp, pMemory[last], pMemory[i]);
 }
 }

 MO_SORT_SWAP(tmp, pMemory[last], pMemory[b]);

 QuickSort(pMemory, b, last-1, pComparer);
 QuickSort(pMemory, last+1, e, pComparer);
 }
 }

static void ListInsertSort(E *pHead, E *pTail, IComparer<T>* pComparer) {
 if(pTail && pHead && pHead != pTail) {
 T tmp;
 for(E *p = pHead->pNext; p != pTail->pNext; p = p->pNext) {
 for(E *pp = p; pp != pHead; pp = pp->pPrior) {
 if(pComparer->Compare(pp->value, pp->pPrior->value) < 0) {
 MO_SORT_SWAP(tmp, pp->value, pp->pPrior->value);
 } else {
 break;
 }
 }
 }
 }
 }

static void ListQuickSort(E *pHead, E *pTail,IComparer<T>* pComparer){
 if(pTail && pHead && pHead != pTail) {
 T tmp;
 T data = pHead->value;
 E *last = pHead;

 for(E *p = pHead->pNext; p != pTail->pNext; p = p->pNext) {
 if(pComparer->Compare(p->value, data) < 0) {
 last = last->pNext;
 MO_SORT_SWAP(tmp, last->value, p->value);
 }
 }

 MO_SORT_SWAP(tmp, last->value, pHead->value);

 if(last != pHead){
 ListQuickSort(pHead, last->pPrior, pComparer);
 }
 if(last != pTail){
 ListQuickSort(last->pNext, pTail, pComparer);
 }
 }
 }

static void SetInsertSort(E *&pHead, E *&pTail, IComparer<T>* pComparer) {
 E *tmp;
 if(pHead != pTail) {
 for(E *p = pHead->pNext; p != pTail->pNext; p = p->pNext) {
 for(E *pp = p; pp != pHead; /*pp = pp->pPrior*/) {
 //MO_SORT_SWAP(tmp, pp->value, pp->pPrior->value);
 SLItemSwap(pHead, pTail, pp, pp->pPrior);
 } else {
 break;
 }
 }
 }
 }

