//============================================================
// <T></T>
//
// @param pValue 
// @param pFormat 
// @return 
//============================================================

TDateTime RDateTime::Parse(TCharC* pValue, TCharC* pFormat){
 MO_ASSERT(pValue);
 struct tm data;
 TCharC* pTempV = pValue;
 TCharC* pTempF = pFormat;
 TChar buffer[5];
 TSize length = strlen(pFormat);
 MO_ASSERT(length > 0);
 TSize tempLen = 0;
 TInt iMsec = 0;
 while(tempLen < length){
 if(*pTempF == '%'){
 pTempF++;
 switch(*pTempF){
 case 'Y':{
 // 4
 for(TInt n = 0;n<4;n++){
 buffer[n] = pTempV[n];
 }
 buffer[4] = '\0';
 TInt iYear = atoi(buffer);
 data.tm_year = iYear - 1900;
 pTempV = pTempV + 4;
 tempLen++;
 break;
 }
 case 'y':{
 // 2
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = '\0';
 TInt iYear = atoi(buffer);
 if(iYear >= 80){
 data.tm_year = iYear;
 }else{
 data.tm_year = iYear + 100;
 }
 pTempV = pTempV + 2;
 tempLen++;
 break;
 }
 case 'm':{
 // 
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = '\0';
 TInt iMon = atoi(buffer);
 MO_ASSERT_RANGE(iMon, 0, 13);
 data.tm_mon = iMon - 1;
 pTempV = pTempV + 2;
 tempLen++;
 break;
 }
 case 'd':{
 // 
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = '\0';
 TInt iDay = atoi(buffer);
 MO_ASSERT_RANGE(iDay, 0, 32);
 data.tm_mday = iDay;
 pTempV = pTempV + 2;
 tempLen++;
 break;
 }
 case 'j':{
 pTempV = pTempV + 3;
 tempLen++;
 break;
 }
 case 'H':{
 // 24
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = '\0';
 TInt iHour = atoi(buffer);
 MO_ASSERT_RANGE(iHour, 0, 24);
 data.tm_hour = iHour;
 pTempV = pTempV + 2;
 tempLen++;
 break;
 }
 case 'M':{
 // 
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = '\0';
 TInt iMin = atoi(buffer);
 MO_ASSERT_RANGE(iMin, 0, 60);
 data.tm_min = iMin;
 pTempV = pTempV + 2;
 tempLen++;
 break;
 }
 case 'S':{
 // 
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = '\0';
 TInt iSec = atoi(buffer);
 MO_ASSERT_RANGE(iSec, 0, 60);
 data.tm_sec = iSec;
 pTempV = pTempV + 2;
 tempLen++;
 break;
 }
 case 's':{
 // 
 buffer[0] = pTempV[0];
 buffer[1] = pTempV[1];
 buffer[2] = pTempV[2];
 buffer[3] = '\0';
 iMsec = atoi(buffer);
 pTempV = pTempV + 3;
 tempLen++;
 break;
 }
 }
 }else{
 pTempV++;
 }
 pTempF++;
 tempLen++;
 }
 TDateTime result = mktime(&data);
 return result * 1000000 + iMsec * 1000;
}

