//============================================================
// <T></T>
//
// @param pBuffer 
// @param length pBuffer
// @param pFormat 
// @param dateTime 
// @return 
//============================================================

TCharC* RDateTime::ToString(TChar* pBuffer, TSize length, TDateTime dateTime, TCharC* pFormat){
 struct tm data;
 time_t time = dateTime / 1000000;
#ifdef _WINDOWS
 MO_ASSERT_ERRNO(localtime_s(&data, &time));
#else
 data = *localtime(&time);
#endif
 TSize lengthF = strlen(pFormat);
 TChar* pWrite = pBuffer;
 TChar buffer[4];
 TSize tempLenV = 0;
 TSize tempLenF = 0;

 while(tempLenF < lengthF&&tempLenV < length){
 if(*pFormat == '%'){
 pFormat++;
 switch(*pFormat++){
 case 'Y':{
 // 42005
 TInt iYear = data.tm_year + 1900;
 RInt::ToString(iYear, buffer, 4);
 for(TInt n = 0;n<4;n++){
 *pWrite++ = buffer[n];
 }
 tempLenF++;
 tempLenV = tempLenV + 4;
 break;
 }
 case 'y':{
 // 205
 TInt iYear;
 TInt temp = data.tm_year;
 if(temp >= 100){
 iYear = temp - 100;
 }else{
 iYear = temp;
 }
 RInt::ToString(iYear, buffer, 2);
 if(iYear < 10){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }
 tempLenF++;
 tempLenV = tempLenV + 2;
 break;
 }
 case 'm':{
 // 
 TInt iMon = data.tm_mon + 1;
 RInt::ToString(iMon, buffer, 2);
 if(iMon < 10){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }
 tempLenF++;
 tempLenV = tempLenV + 2;
 break;
 }
 case 'd':{
 // 
 TInt iDay = data.tm_mday;
 RInt::ToString(iDay, buffer, 2);
 if(iDay < 10){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }
 tempLenF++;
 tempLenV = tempLenV + 2;
 break;
 }
 //case 'j':{
 // pTempV = pTempV + 3;
 // break;
 // }
 case 'H':{
 // 24
 TInt iHour = data.tm_hour;
 RInt::ToString(iHour, buffer, 2);
 if(iHour < 10){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }
 tempLenF++;
 tempLenV = tempLenV + 2;
 break;
 }
 //case 'h':{
 // break;
 // }
 case 'M':{
 // 
 TInt iMin = data.tm_min;
 RInt::ToString(iMin, buffer, 2);
 if(iMin < 10){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }
 tempLenF++;
 tempLenV = tempLenV + 2;
 break;
 }
 case 'S':{
 // 
 TInt iSec = data.tm_sec;
 RInt::ToString(iSec, buffer, 2);
 if(iSec < 10){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }
 tempLenF++;
 tempLenV = tempLenV + 2;
 break;
 }
 case 's':{
 // 
 TInt iMsec = (dateTime % 1000000) / 1000;
 RInt::ToString(iMsec, buffer, 3);
 if(iMsec < 10){
 *pWrite++ = '0';
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 }else if(iMsec < 100){
 *pWrite++ = '0';
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 }else{
 *pWrite++ = buffer[0];
 *pWrite++ = buffer[1];
 *pWrite++ = buffer[2];
 }
 tempLenF++;
 tempLenV = tempLenV + 3;
 break;
 }
 }
 }else{
 *pWrite++ = *pFormat++;
 tempLenV++;
 }
 tempLenF++;
 }
 *pWrite = '\0';
 return pBuffer;
}

//============================================================
// <T>16</T>
//
// @param pValue 
// @return 
//============================================================

TDouble RDouble::ParseHex(TCharC* pValue){
 MO_ASSERT(pValue);
 TByte result[sizeof(TDouble)];
 // 
 for(TInt n=0; n<sizeof(TDouble); n++){
 // 4
 TChar8 hbyte = *pValue++;
 if(hbyte >= '0' && hbyte <= '9'){
 hbyte = hbyte - '0';
 }else if(hbyte >= 'a' && hbyte <= 'f'){
 hbyte = hbyte - 'a' + 10;
 }else if(hbyte >= 'A' && hbyte <= 'F'){
 hbyte = hbyte - 'A' + 10;
 }else{
 MO_THROW("Unknown Double format.");
 }
 // 4
 TChar8 lbyte = *pValue++;
 if(lbyte >= '0' && lbyte <= '9'){
 lbyte = lbyte - '0';
 }else if(lbyte >= 'a' && lbyte <= 'f'){
 lbyte = lbyte - 'a' + 10;
 }else if(lbyte >= 'A' && lbyte <= 'F'){
 lbyte = lbyte - 'A' + 10;
 }else{
 MO_THROW("Unknown Double format.");
 }
 // 
 result[n] = (hbyte << 4) + lbyte;
 }
 return *(TDouble*)result;
}

