TCharC* RDouble::ToHexString(TDouble value, TChar* pBuffer, TSize length){
 TByte* pValue = (TByte*)&value;
 TChar* pWrite = pBuffer;
 // 
 for(TInt n=0; n<sizeof(TDouble); n++){
 TChar ch = pValue[n];
 TInt byte = (ch >= 0) ? ch : 0x100 + ch;
 *pWrite++ = RByte::HEX_CHARS[byte >> 4];
 *pWrite++ = RByte::HEX_CHARS[byte & 0x0F];
 }
 // 
 *pWrite = 0;
 return pBuffer;
}

