// <P>-home</P>
//
// @param pPath 
// @param ... 
// @return 
//============================================================

TFsPath REnvironment::MappingPath(TCharC* pPath, ...){
   MO_ASSERT(pPath);
#ifdef _WINDOWS
   TFsPath path = RApplication::GetCurrentDirectory();
#else
   // 
   TCharC* pHome = RApplication::FindArgument(MO_ARG_HOME);
   MO_ASSERT(pHome);
   TFsPath path = pHome;
#endif
   // 
   va_list params;
   va_start(params, pPath);
   // 
   path.AppendFormat(pPath, params);
   // 
   va_end(params);
   // 
   path.Replace('\', '/');
   return path;
}

