//============================================================

TChar* RInt::ToHexString(TInt value, TChar* pBuffer, TInt length){
 MO_ASSERT(pBuffer);
 TInt n = -1;
 TChar* pResult = pBuffer;
 do{
 // 
 pResult[++n] = RByte::HEX_CHARS[value % 16];
 value /= 16;
 }while(value > 0);
 // 
 TInt position = (n + 1) / 2;
 while(position-- > 0){
 // 
 TChar temp = pResult[position];
 pResult[position] = pResult[n - position];
 pResult[n - position] = temp;
 }
 // 
 pResult[n + 1] = '\0';
 return pBuffer;
}

//============================================================
// <T></T>
//
// @param size 
// @param pBuffer 
// @param length 
// @return 
//============================================================

TCharC* RInt::FormatCapacity(TSize size, TChar* pBuffer, TInt length){
 // 
 TFsCode format;
 TInt gBytes = (size >> 30);
 if(gBytes > 0){
 format.AppendFormat("%3dG.", gBytes);
 }
 TInt mBytes = (size >> 20) % 1024;
 if(gBytes || mBytes > 0){
 if(gBytes){
 format.AppendFormat("%03dM.", mBytes);
 }else{
 format.AppendFormat("%3dM.", mBytes);
 }
 }
 TInt kBytes = (size >> 10) % 1024;
 if(gBytes || mBytes || kBytes > 0){
 if(gBytes || mBytes){
 format.AppendFormat("%03dK.", kBytes);
 }else{
 format.AppendFormat("%3dK.", kBytes);
 }
 }
 if(gBytes || mBytes || kBytes){
 format.AppendFormat("%03dB", size % 1024);
 }else{
 format.AppendFormat("%3dB", size % 1024);
 }
 // 
 TInt copied = MO_MIN(format.Length() + 1, length - 1);
 memcpy(pBuffer, format.MemoryC(), copied);
 return pBuffer;
}

