void RNetSocket::Startup(){
#ifdef _WINDOWS
 TUint16 wVersionRequested = MAKEWORD( 2, 2 );
 WSADATA wsaData;
 RMemory::Clear(&wsaData, sizeof(wsaData));
 MO_STATIC_DEBUG("Socket environment startup (version=2.2)");
 TInt error = WSAStartup(wVersionRequested, &wsaData);
 MO_ASSERT(0 == error);
#endif
}

