TChar8* RRuntime::IntToString8(TInt value, TChar8* pBuffer, TSize length){
 TInt n = -1;
 TChar* pResult = pBuffer;
 if(value < 0){
 // 
 *pResult++ = '-';
 // 
 value = -value;
 }
 do{
 // 
 pResult[++n] = value % 10 + '0';
 value /= 10;
 }while(value > 0);
 // 
 TInt position = (n + 1) / 2;
 while(position-- > 0){
 // 
 TChar temp = pResult[position];
 pResult[position] = pResult[n - position];
 pResult[n - position] = temp;
 }
 // 
 pResult[n + 1] = '\0';
 return pBuffer;
}

