TShareKey RShareMemory::MakeKey(TCharC* pFileName, TInt id){
#ifdef _LINUX
 TShareKey key = ftok(pFileName, id);
 if(key < 0){
 MO_STATIC_PFATAL(ftok);
 }
 return key;
#endif
 return -1;
}

//============================================================
// <T></T>
//
// @param key 
// @param [out] info 
// @return 
//============================================================

TBool RShareMemory::FetchInfo(TShareKey key, SShareMemoryInfo& info){
#ifdef _LINUX
 MO_STATIC_DEBUG("Fetch info share memory info. (key=0x%08X)", key);
 // 
 TInt handle = shmget(key, 0, MO_SHARE_MEMORY_ACCESS);
 if(handle < 0){
 return EFalse;
 }
 // 
 TByte* pMemory = (TByte*)shmat(handle, NULL, 0);
 MO_ASSERT(pMemory);
 SShareMemoryInfo* pInfo = (SShareMemoryInfo*)pMemory;
 // 
 if(0 != memcmp(pInfo->flag, MO_SHARE_MEMORY_FLAG, sizeof(pInfo->flag))){
 MO_STATIC_DEBUG("Share memory is not system type memory. (key=0x%08X)", key);
 return EFalse;
 }
 // 
 info = *pInfo;
 TChar format[MO_MEMORY_FORMATLENGTH];
 MO_STATIC_DEBUG("Fetch share memory info success. (key=0x%08X, size=%s)",
 key, RInt::FormatCapacity(info.size, format, MO_MEMORY_FORMATLENGTH));
#endif
 return ETrue;
}

//============================================================
// <T></T>
// <P></P>
//
// @param key 
// @param size 
// @return 
//============================================================

TAny* RShareMemory::Create(TShareKey key, TSize size){
#ifdef _LINUX
   // 
   TInt handle = shmget(key, 0, MO_SHARE_MEMORY_ACCESS);
   if(handle < 0){
      MO_STATIC_PERROR(shmget);
   }else{
      // 
      TByte* pMemory = (TByte*)shmat(handle, NULL, 0);
      MO_ASSERT(pMemory);
      // 
      if(ESuccess != shmdt(pMemory)){
         MO_STATIC_PFATAL(shmdt);
      }
      // 
      MO_STATIC_DEBUG("Remove old share memory. (key=0x%08X)", key);
      if(ESuccess != shmctl(handle, IPC_RMID, NULL)){
         MO_STATIC_PFATAL(shmctl);
      }
   }
#endif
   // 
   return InnerCreate(key, size);
}

//============================================================
// <T></T>
// <P></P>
// <P></P>
//
// @param key 
// @param size 
// @param created 
// @return 
//============================================================

TAny* RShareMemory::TryCreate(TShareKey key, TSize size, TBool& created){
#ifdef _LINUX
   MO_STATIC_DEBUG("Fetch info share memory info. (key=0x%08X)", key);
   // 
   TInt handle = shmget(key, 0, MO_SHARE_MEMORY_ACCESS);
   if(handle >= 0){
      // 
      TByte* pMemory = (TByte*)shmat(handle, NULL, 0);
      MO_ASSERT(pMemory);
      SShareMemoryInfo* pInfo = (SShareMemoryInfo*)pMemory;
      // 
      if(memcmp(pInfo->flag, MO_SHARE_MEMORY_FLAG, sizeof(pInfo->flag))){
         // 
         if(pInfo->size == size){
            created = EFalse;
            return pMemory + sizeof(SShareMemoryInfo);
         }
      }
      // 
      if(ESuccess != shmdt(pMemory)){
         MO_STATIC_PFATAL(shmdt);
      }
      // 
      MO_STATIC_DEBUG("Remove share memory. (key=0x%08X)", key);
      if(ESuccess != shmctl(handle, IPC_RMID, NULL)){
         MO_STATIC_PFATAL(shmctl);
      }
   }
#endif
   // 
   created = ETrue;
   return InnerCreate(key, size);
}

//============================================================
// <T></T>
//
// @param key 
// @return 
//============================================================

TAny* RShareMemory::Connect(TShareKey key){
#ifdef _LINUX
 MO_STATIC_DEBUG("Connect share memory. (key=0x%08X)", key);
 // 
 TInt handle = shmget(key, 0, MO_SHARE_MEMORY_ACCESS);
 if(handle < 0){
 MO_STATIC_PFATAL(shmget);
 }
 // 
 TByte* pMemory = (TByte*)shmat(handle, NULL, 0);
 MO_ASSERT(pMemory);
 SShareMemoryInfo* pInfo = (SShareMemoryInfo*)pMemory;
 // 
 if(memcmp(pInfo->flag, MO_SHARE_MEMORY_FLAG, sizeof(pInfo->flag))){
 MO_STATIC_DEBUG("Connect share memory failure. (key=0x%08X)", key);
 return NULL;
 }
 TChar format[MO_MEMORY_FORMATLENGTH];
 MO_STATIC_DEBUG("Connect share memory success. (key=0x%08X, memory=0x%08X, size=%s)",
 key, pMemory, RInt::FormatCapacity(pInfo->size, format, MO_MEMORY_FORMATLENGTH));
 return pMemory + sizeof(SShareMemoryInfo);
#endif
 return NULL;
}

