//============================================================
// <T>ANSI</T>
//
// @param pValues ANSI
// @return 
//============================================================

THashCode RString16::MakeHashCode(TChar16C* pValues){
 MO_ASSERT(pValues);
 return RTypes<TChar16>::MakeHashCode(pValues, wcslen(pValues));
}

//============================================================
// <T>ANSI</T>
//
// @param pValues ANSI
// @return 
//============================================================

THashCode RString16::MakeNocaseHashCode(TChar16C* pValues){
 MO_ASSERT(pValues);
 THashCode hash = 0;
 TInt length = wcslen(pValues);
 while(--length >= 0){
 hash += (hash << 4) + (hash << 3) + (hash << 2) + (hash << 1) + tolower(pValues[length]);
 }
 return hash;
}

//============================================================
// <T>ANSI</T>
//
// @param ptr ANSI
// @return 
//============================================================

TBool RString16::AllocCopy(TChar16C* pValues, TChar16** ppTarget){
 if(NULL != pValues){
 TSize length = wcslen(pValues) + 1;
 TChar16* pAlloc = RTypeMemory<TChar16>::Alloc(length);
 MO_ASSERT(pAlloc);
 MO_LIB_MEMCPY(pAlloc, length, pValues, length);
 *ppTarget = pAlloc;
 }
 return ETrue;
}

