//============================================================
// <T>16</T>
//
// @param pTarget
// @param size pTarget
// @param pValue 
// @return -1
//============================================================

TInt RString8::ConvertToString32(TChar32* pTarget, TSize size, TChar8C* pValue){
 TUint inLength = strlen(pValue);
 TUint outLength = inLength + 1;
 TUint tempLength = outLength * 4;//iconvpOut4
 MO_ASSERT(size >= outLength);
 TChar8* pIn = (TChar8*)&pValue;
 TChar32* pOut = pTarget;

 iconv_t cd = iconv_open("WCHAR_T", "ASSII");
 if(iconv_t(-1) == cd){
 MO_STATIC_ERROR("iconv_open fail!");
 }
 int result = iconv(cd, &pIn, &inLength, (TChar8**)&pOut, &tempLength);
 if(-1 == result){
 MO_STATIC_ERROR("iconv error!");
 return -1;
 }
 pTarget[outLength] = 0;
 iconv_close(cd);
 return outLength;
}

