static T& Default() {
 return _default;
 }

static T Nvl(T value, T other) {
 return (_default == value) ? other : _default;
 }

static void Clear(TAny* pMemory) {
 memset(pMemory, 0, sizeof(T));
 }

static T* Alloc(TUint size){
 TUint total = sizeof(T) * size;
 T* pAlloc = (T*)malloc(total);
 MO_ASSERT(NULL != pAlloc);
 return pAlloc;
 }

static T* Alloc(TUint size, T value){
 TInt total = sizeof(T) * size;
 T* pAlloc = (T*)malloc(total);
 MO_ASSERT(NULL != pAlloc);
 RTypes<T>::Fill(pAlloc, size, value);
 return pAlloc;
 }

static T* Realloc(T* pMemory, TUint size){
 MO_ASSERT(pMemory);
 TInt total = sizeof (T) * size;
 T* pAlloc = (T*)malloc(total);
 MO_ASSERT(pAlloc);
 memcpy(pAlloc, pMemory, total);
 free(pMemory);
 return pAlloc;
 }

static void Free(TAny* pMemory){
 MO_ASSERT(pMemory);
 free(pMemory);
 }

static void ReleaseItems(T* pMemory, TUint offset, TUint count){
 for(TUint n = 0; n < count; n++){
 T pItem = pMemory[offset + n];
 if(NULL != pItem){
 delete pItem;
 pMemory[n] = NULL;
 }
 }
 }

static void Release(T* pMemory, TUint offset, TUint count){
 ReleaseItems(pMemory, 0, count);
 free(pMemory);
 }

static TBool Contains(const T* pValues, TInt length, T value){
 MO_ASSERT(pValues);
 while(--length >= 0){
 if(*pValues++ == value){
 return ETrue;
 }
 }
 return EFalse;
 }

static TBool Equals(const T* pSource, const T* pTarget, TInt length){
 MO_ASSERT(pSource);
 MO_ASSERT(pTarget);
 // 
 while(--length >= 0){
 if(*pSource++ != *pTarget++){
 return EFalse;
 }
 }
 return ETrue;
 }

static TBool Equals(const T* pSource, TInt sourceLength, const T* pTarget, TInt targetLength){
 MO_ASSERT(pSource);
 MO_ASSERT(pTarget);
 // 
 if(sourceLength != targetLength){
 return EFalse;
 }
 // 
 while(--sourceLength >= 0){
 if(*pSource++ != *pTarget++){
 return EFalse;
 }
 }
 return ETrue;
 }

static TBool StartsWith(const T* pValues, TInt valueLength, const T* pFind, TInt findLength){
 MO_ASSERT(pValues);
 MO_ASSERT(pFind);
 // 
 if(valueLength < findLength){
 return EFalse;
 }
 // 
 return Equals(pValues, pFind, findLength);
 }

static TBool EndsWith(const T* pValues, TInt valueLength, const T* pFind, TInt findLength){
 MO_ASSERT(pValues);
 MO_ASSERT(pFind);
 // 
 if(valueLength < findLength){
 return EFalse;
 }
 // 
 return Equals(pValues + valueLength - findLength, pFind, findLength);
 }

static TInt Compare(const T* pSource, TInt sourceLength, const T* pTarget, TInt targetLength){
 MO_ASSERT(pSource);
 MO_ASSERT(pTarget);
 // 
 TInt n = -1;
 TInt loop = MO_MIN(sourceLength, targetLength);
 while(++n < loop){
 if(pSource[n] != pTarget[n]){
 return pSource[n] - pTarget[n];
 }
 }
 // 
 return sourceLength - targetLength;
 }

static TInt IndexOf(const T* pValues, T value){
 MO_ASSERT(pValues);
 const T* pSearch = pValues;
 while(ETrue){
 if(*pSearch == value){
 return pSearch - pValues;
 }
 pSearch++;
 }
 return ENotFound;
 }

static TInt IndexOf(const T* pValues, TInt length, T value){
 MO_ASSERT(pValues);
 const T* pSearch = pValues;
 while(--length >= 0){
 if(*pSearch == value){
 return pSearch - pValues;
 }
 pSearch++;
 }
 return ENotFound;
 }

static TInt LastIndexOf(const T* pValues, TInt length, T value){
 MO_ASSERT(pValues);
 const T* pSearch = pValues + length;
 while(--length >= 0){
 pSearch--;
 if(*pSearch == value){
 return pSearch - pValues;
 }
 }
 return ENotFound;
 }

static TInt Find(const T* pValues, TInt valueLength, const T* pFind, TInt findLength){
 MO_ASSERT(pValues);
 MO_ASSERT(pFind);
 // 
 const T& first = pFind[0];
 // 
 TInt position = -1;
 TInt length = valueLength - findLength;
 while(++position <= length){
 // 
 if(pValues[position] == first){
 TInt n = 0;
 while(++n < findLength){
 if(pValues[position + n] != pFind[n]){
 break;
 }
 }
 // 
 if(n == findLength){
 return position;
 }
 }
 }
 // 
 return ENotFound;
 }

static TInt LastFind(const T* pValues, TInt valueLength, const T* pFind, TInt findLength){
 MO_ASSERT(pValues);
 MO_ASSERT(pFind);
 // 
 const T& first = pFind[0];
 // 
 TInt position = -1;
 TInt length = valueLength - findLength;
 while(++position <= length){
 // 
 if(pValues[length - position] == first){
 TInt n = 0;
 while (++n < findLength){
 if (pValues[position + n] != pFind[n]){
 break;
 }
 }
 // 
 if(n == findLength){
 return position;
 }
 }
 }
 // 
 return ENotFound;
 }

static void Fill(T* pValues, TInt length, T value){
 MO_ASSERT(pValues);
 while(--length >= 0){
 *pValues++ = value;
 }
 }

static void Copy(T* pTarget, const T* pSource, TInt length){
 MO_ASSERT(pSource);
 MO_ASSERT(pTarget);
 memcpy(pTarget, pSource, sizeof(T) * length);
 }

static void Move(T* pTarget, const T* pSource, TInt length){
 MO_ASSERT(pSource);
 MO_ASSERT(pTarget);
 memmove(pTarget, pSource, sizeof(T) * length);
 }

static void Replace(T* pValues, TInt length, T source, T target){
 MO_ASSERT(pValues);
 while(--length >= 0){
 if(pValues[length] == source){
 pValues[length] = target;
 }
 }
 }

static THashCode MakeHashCode(const T* pValues, TInt length){
 MO_ASSERT(pValues);
 THashCode hash = 0;
 while(--length >= 0){
 hash += (hash << 4) + (hash << 3) + (hash << 2) + (hash << 1) + pValues[length];
 }
 return hash;
 }

static void Clear(T* pValues, TInt length){
 MO_ASSERT(pValues);
 memset(pValues, 0, sizeof(T) * length);
 }

//============================================================
// <T></T>
//
// @param value 
// @return 
//============================================================

TCharC* RUint::ToString(TUint value, TChar* pBuffer, TSize length){
 MO_ASSERT(pBuffer);
 TInt n = -1;
 TChar* pResult = pBuffer;
 do{
 // 
 pResult[++n] = value % 10 + '0';
 value /= 10;
 }while(value > 0);
 // 
 TInt position = (n + 1) / 2;
 while(position-- > 0){
 // 
 TChar temp = pResult[position];
 pResult[position] = pResult[n - position];
 pResult[n - position] = temp;
 }
 // 
 pResult[n + 1] = '\0';
 return pBuffer;
}

TCharC* RUint::ToHexString(TUint value, TChar* pBuffer, TSize length){
 MO_ASSERT(pBuffer);
 TInt n = -1;
 TChar* pResult = pBuffer;
 do{
 // 
 pResult[++n] = RByte::HEX_CHARS[value % 16];
 value /= 16;
 }while(value > 0);
 // 
 TInt position = (n + 1) / 2;
 while(position-- > 0){
 // 
 TChar temp = pResult[position];
 pResult[position] = pResult[n - position];
 pResult[n - position] = temp;
 }
 // 
 pResult[n + 1] = '\0';
 return pBuffer;
}

