TUint64 RUint64::ParseHex(TCharC* pValue){
 MO_ASSERT(pValue);
#ifdef _WINDOWS
 TUint length = strlen(pValue);
 TUint64 temp = 0;
 for(TUint i = 0; i < length; i++){
 for(TUint j = 0; j < 16; j++){
 if(pValue[i] == RByte::HEX_CHARS[j]){
 temp += j;
 }
 }
 temp = temp<<4;
 }
 return temp;
#else
 return strtoull(pValue, 0, 16);
#endif

}

