//============================================================
// <T></T>
//
// @param pLocation 
// @param pBuffer 
// @param size 
//============================================================

void RVirtualMemory::Write(TAny* pLocation, TAny* pBuffer, TUint size){
 HANDLE hProcess = GetCurrentProcess();
 // (pLocation)(pLocation+size)
 TUint32 storeProtection;
 VirtualProtectEx(hProcess, pLocation, size, PAGE_READWRITE, &storeProtection);
 // 
 WriteProcessMemory(hProcess, pLocation, pBuffer, size, NULL);
 // 
 TUint32 tempProtection;
 VirtualProtectEx(hProcess, pLocation, size, storeProtection, &tempProtection);
}

//============================================================
// <T></T>
//
// @param pLocation 
// @param pBuffer 
// @param size 
//============================================================

void RVirtualMemory::Read(TAny* pLocation, TAny* pBuffer, TUint size){
 TUint32 readSize = 0;
 HANDLE hProcess = GetCurrentProcess();
 MO_CHECK(ReadProcessMemory(hProcess, pLocation, pBuffer, size, &readSize));
 MO_ASSERT(readSize == size);
}

//============================================================
// <T></T>
//============================================================

TBool RXml::MakeNodeAttribute(TString& target, TCharC* pValue){
 if(NULL == pValue){
 return EFalse;
 }
 TSize length = strlen(pValue);
 if(0 == length){
 return EFalse;
 }
 for(TSize n=0; n<length; n++){
 TChar value = pValue[n];
 if('&' == value){
 target.Append("&amp;");
 }else if('"' == value){
 target.Append("&quot;");
 }else if('<' == value){
 target.Append("&lt;");
 }else if('>' == value){
 target.Append("&gt;");
 }else if('' == value){
 continue;
 }else if('
' == value){
 target.Append("\n");
 }else{
 target.Append(value);
 }
 }
 return ETrue;
}

