 if('&' == value){
 target.Append("&amp;");
 }else if('"' == value){
 target.Append("&quot;");
 }else if('<' == value){
 target.Append("&lt;");
 }else if('>' == value){
 target.Append("&gt;");
 }else if('' == value){
 continue;
 }else if('
' == value){
 target.Append("\n");
 }else{
 target.Append(value);
 }
 }
 return ETrue;
}

