SMatrix2x2Tpl operator*(SMatrix2x2Tpl& v){
 return Multiply(v);
 }

void Reset(){
 for(TInt j=0; j<2; j++){
 for(TInt i=0; i<2; i++){
 m[j][i] = 0;
 }
 }
 }

SPoint2Tpl<T> Multiply(SPoint2Tpl<T>& v){
 SPoint2Tpl<T> r;
 r.x = (v.x * m[0][0]) + (v.y * m[0][1]);
 r.y = (v.x * m[1][0]) + (v.y * m[1][1]);
 return r;
 }

SMatrix2x2Tpl Multiply(SMatrix2x2Tpl& v){
 SMatrix2x2Tpl r;
 for(TInt j=0; j<2; j++){
 for(TInt i=0; i<2; i++){
 for(TInt k=0; k<2; k++){
 r.m[j][i] += m[j][k] * v.m[k][i];
 }
 }
 }
 return r;
 }

SMatrix3x3Tpl operator*(SMatrix3x3Tpl& v){
 return Multiply(v);
 }

void Reset(){
 for(TInt j=0; j<3; j++){
 for(TInt i=0; i<3; i++){
 m[j][i] = 0;
 }
 }
 }

T Absolute(){
 T v = 0;
 for(TInt j=0; j<3; j++){
 for(TInt i=0; i<3; i++){
 v += m[j][i] * m[j][i];
 }
 }
 return sqrt(v);
 }

SPoint3Tpl<T> Multiply(SPoint3Tpl<T>& v){
 SPoint3Tpl<T> r;
 r.x = v.x*m[0][0] + v.y*m[0][1] + v.z*m[0][2];
 r.y = v.x*m[1][0] + v.y*m[1][1] + v.z*m[1][2];
 r.z = v.x*m[2][0] + v.y*m[2][1] + v.z*m[2][2];
 return r;
 }

SMatrix3x3Tpl Multiply(SMatrix3x3Tpl& v){
 SMatrix3x3Tpl r;
 for(TInt j=0; j<3; j++){
 for(TInt i=0; i<3; i++){
 for(TInt k=0; k<3; k++){
 r.m[j][i] += m[j][k] * v.m[k][i];
 }
 }
 }
 return r;
 }

void Normalize(){
