 }
 }
 }

void Set(SMatrix3x3Tpl<T>* pMatrix){
 for(TInt j=0; j<4; j++){
 for(TInt i=0; i<4; i++){
 if((3 == j) && (3 == i)){
 m[j][i] = 1;
 }else if((3 == j) || (3 == i)){
 m[j][i] = 0;
 }else{
 m[j][i] = pMatrix->m[j][i];
 }
 }
 }
 }

