SQuaternionTpl Multiply(SQuaternionTpl& v){
 SQuaternionTpl r;
 r.x = (w * v.x) + (x * v.w) + (y * v.z) - (z * v.y);
 r.y = (w * v.y) + (y * v.w) + (z * v.x) - (x * v.z);
 r.z = (w * v.z) + (z * v.w) + (x * v.y) - (y * v.x);
 r.w = (w * v.w) - (x * v.x) - (y * v.y) - (z * v.z);
 return r;
 }

