//============================================================

TBool TClassInfo::Parse(TCharC* pValue){
 TFsName fullName = pValue;
 TInt length = fullName.Length();
#ifndef _WINDOWS
 TInt spaceLenStart = fullName.IndexOf('N') + 1;
 TInt spaceLenEnd = spaceLenStart;
 for(TInt i = spaceLenStart; i < length; i++){
 if(!RChar::IsDigit(fullName[i])){
 break;
 }
 spaceLenEnd++;
 }
 TFsName spaceLenStr = fullName.SubPtrC(spaceLenStart, spaceLenEnd);
 TInt spaceLen = RInt::Parse(spaceLenStr.MemoryC());
 MO_ASSERT(spaceLen < length);
 _space = fullName.SubPtrC(spaceLenEnd, spaceLenEnd + spaceLen);
 TInt nameLenStart = spaceLenEnd + spaceLen;
 TInt nameLenEnd = nameLenStart;
 for(TInt i = nameLenStart; i < length; i++){
 if(!RChar::IsDigit(fullName[i])){
 break;
 }
 nameLenEnd++;
 }
 TFsName nameLenStr = fullName.SubPtrC(nameLenStart, nameLenEnd);
 TInt nameLen = RInt::Parse(nameLenStr.MemoryC());
 MO_ASSERT(nameLen < length);
 _name = fullName.SubPtrC(nameLenEnd, nameLenEnd + nameLen);
 _fullName.AppendFormat("%s::%s", _space.MemoryC(), _name.MemoryC());
#else
 // class MO::FList
 TInt spaceStart = fullName.IndexOf(' ') + 1;
 TInt spaceEnd = fullName.IndexOf(':');
 _space = fullName.SubPtrC(spaceStart, spaceEnd);
 _name = fullName.SubPtrC(spaceEnd + 2, length);
 _fullName = fullName.SubPtrC(spaceStart, length);
#endif
 return ETrue;
}

