void TFileInfo::InnerInitialize(){

#ifdef _WINDOWS
 _filename.Replace('\', '/');
#endif
 // 
 TInt driverEnd = _filename.IndexOf(':');
 if(ENotFound != driverEnd){
 _driver = _filename.LeftPtrC(driverEnd);
 }
 // 
 TInt nameStartIndex = _filename.LastIndexOf('/');
 if(ENotFound == nameStartIndex){
 _path.Assign(".");
 _name = _filename;
 }else{
 _path = _filename.LeftPtrC(nameStartIndex);
 _name = _filename.RightPtrC(_filename.Length() - nameStartIndex - 1);
 }
 // 
 TInt extensionStart = _name.LastIndexOf('.');
 if(ENotFound != extensionStart){
 _extension = _name.RightPtrC(_name.Length() - extensionStart - 1);
 }
}

