 if (size > (this->_entryCount << 3)) {
 // 
 size = this->_entryCount + (MO_MAX(this->_entryCount, size) >> 1);
 // 8
 SEntry** ppEntries = RTypeMemory<SEntry*>::Alloc(size, NULL);
 EntriesResize(ppEntries, size);
