TBool Set(T code){
 TInt position = code % _capacity;
 E* pEntries = _pAllocator->Entries();
 // 
 I current = _gEntries[position];
 while(current >= 0){
 if(pEntries[current].code == code){
 return EFalse;
 }
 current = pEntries[current].link;
 }
 // 
 TInt index;
 E& entry = _pAllocator->Alloc(index);
 entry.link = current;
 entry.code = code;
 _gEntries[position] = index;
 // 
 if(_gHead->last < 0){
 _gHead->first = index;
 }else{
 pEntries[_gHead->last].next = index;
 }
 // 
 entry.prior = _gHead->last;
 entry.next = -1;
 _gHead->count++;
 _gHead->last = index;
 return ETrue;
 }

void Clear(){
 // 
 _pAllocator->Free(_gHead->count, _gHead->first, _gHead->last);
 // 
 _gHead->count = 0;
 _gHead->first = -1;
 _gHead->last = -1;
 RTypes<I>::Fill(_gEntries, _capacity, -1);
 }

