 }
#endif
}

//============================================================
// <T></T>
//============================================================

void TThreadMutex::Enter(){
#ifdef _WINDOWS
 EnterCriticalSection(&_section);
#else
 TInt result = pthread_mutex_lock(&_section);
 if(ESuccess != result){
 // EAGAIN
 // EDEADLK
 // EOWNERDEAD
 // 
 // ENOTRECOVERABLE
 // 
 // 
 MO_PFATAL(pthread_mutex_lock);
 }
#endif
}

//============================================================
// <T></T>
//============================================================

void TThreadMutex::TryEnter(){
#ifdef _WINDOWS
 EnterCriticalSection(&_section);
#else
 TInt result = pthread_mutex_trylock(&_section);
 if(ESuccess != result){
 // EBUSY mutex 
 // EAGAIN mutex 
 // EOWNERDEAD
 // 
 // ENOTRECOVERABLE
 // 
 // 
 // ENOMEM
 MO_PFATAL(pthread_mutex_trylock);
 }
#endif
}

//============================================================
// <T></T>
//============================================================

void TThreadMutex::Leave(){
#ifdef _WINDOWS
 LeaveCriticalSection(&_section);
#else
 TInt result = pthread_mutex_unlock(&_section);
 if(ESuccess != result){
 // EPERM
 MO_PFATAL(pthread_mutex_unlock);
 }
#endif
}

