void EnsureSize(TInt size){
 if(size > this->_size){
 // 1.5<C>MO_MEMORY_CAPACITY</C>
 this->_size = MO_MAX(MO_MEMORY_CAPACITY, size);
 this->_size += this->_size >> 1;
 T* pMemory = RTypeMemory<T>::Alloc(this->_size, NULL);
 if(this->_count > 0){
 RTypes<T>::Copy(pMemory, this->_pMemory, this->_count);
 }
 RTypeMemory<T>::Free(this->_pMemory);
 this->_pMemory = pMemory;
 }
 }

inline void InnerInitialize(T* pMemory, TInt count){
 _pMemory = pMemory;
 _count = count;
 _index = -1;
 }

inline const T& operator *() const{
 MO_ASSERT(_pMemory);
 MO_ASSERT_RANGE(_index, 0, _count);
 return _pMemory[_index];
 }

inline const T operator->() const{
 MO_ASSERT(_pMemory);
 MO_ASSERT_RANGE(_index, 0, _count);
 return _pMemory[_index];
 }

inline TBool IsEmpty(){
 return (0 == _count);
 }

inline TBool Equals(T value){
 MO_ASSERT(_pMemory);
 MO_ASSERT_RANGE(_index, 0, _count);
 return _pMemory[_index] == value;
 }

inline TBool HasNext(){
 return (_count > 0) ? _index + 1 < _count : EFalse;
 }

inline TBool Next(){
 if(_count > 0 && (_index + 1 < _count)){
 _index++;
 return ETrue;
 }
 return EFalse;
 }

inline TBool HasPrior(){
 return (_count > 0) ? _index - 1 >= 0 : EFalse;
 }

inline TBool Prior(){
 if(_count > 0 && (_index + 1 < _count)){
 _index--;
 return ETrue;
 }
 return EFalse;
 }

inline T Get(){
 MO_ASSERT(_pMemory);
 MO_ASSERT_RANGE(_index, 0, _count);
 return _pMemory[_index];
 }

inline void Reset(){
 _index = -1;
 }

