TBool TXmlNodeIteratorC::Next(TCharC* pName){
 while(ETrue){
 // 
 _pEntry = (NULL == _pEntry) ? _pStart : _pEntry->pNext;
 if(NULL == _pEntry){
 break;
 }
 // 
 if(_pEntry->value->IsName(pName)){
 break;
 }
 }
 return (NULL != _pEntry);
}
